INSERT INTO JOKES (JOKES_TEXT) VALUES ('Учительница этики попала молотком себе по пальцу и на полчаса стала учителем труда.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Дима настолько никчемный, что даже пукнуть не может без сотрясения мозга!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Совет дня: никогда не пытайся поймать падающий кактус.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Вам скучно?... Вам нечего делать?... Родите ребенка... и всё пройдёт!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Обливание холодной водой дарит хорошее настроение! Причём, всё равно, кого ты обливаешь.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Бэтмен на свидание с женщиной-кошкой купил вино, розы и лоток.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Пап, а откуда я взялся? Да проблема сынок не в том, откуда ты взялся , а нахрена я туда полез...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Самая нелюбимая поговорка сапера: "Одна нога - здесь, другая - там".');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Очень невнимательные родители нашли своего ребенка не в капусте, а уже в готовом голубце.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Слава - это когда твоя фамилия в "Ворде" красненьким не подчеркивается.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Девушка, у меня к вам небольшое дело. Ну, выкладывай...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Я не извращенец - я наслажденец!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В Китае из тюрьмы сбежал особо опасный преступник. По составленному фотороботу было арестовано 140 деревень.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Уж климакс близится, а Германа всё нет.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Желудок у котенка не больше наперстка, а как насрет, так и не поверишь...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Алкоголик Дима 5 лет проживший в Китае, блюёт по фен-шую!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Чтобы заставить проктолога плакать, надо спросить его кем он мечтал стать в детстве.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В день, когда начнётся страшный суд, богу достаточно будет просто просмотреть список запросов подсудимого в поисковых системах.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Николай Валуев живет на третьем этаже. И немножко на четвертом.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Самое длинное слово в русском языке: Слово о Полку Игореве.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Семилетняя девочка из Тюмени, пытаясь похоронить своего попугайчика, стала нефтяной магнаткой.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Когда женщина говорит: "Эта кyхня такая неyдобная", это значит: "Я хочy новый дом!"');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Троллейбус-гармошка выезжая из депо, запутался и превратился в троллейбус-узелок.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Будь осторожен: растягивая удовольствие, не порви его.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Половые тряпки делятся на те, которые носила мама, и те, в которых спал папа.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('У меня жена суп всё время пересаливает. Думал сначала, что влюбилась. А она говорит, просто у нас соли до хрена, а срок годности к концу подходит.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Если чёрная кошка перебежала дорогу в Москве, то ей крупно повезло.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Крановщик с пятнадцатилетним стажем за пять минут обчистил автомат с игрушками.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Ремонт - когда обувь вытираешь не входя в квартиру, а выходя из нее.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Если человек счастлив больше одного дня, значит от него что-то скрывают!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Привет, я - мягкий знак, и вы заколебали пихать меня куда попало!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Если вовремя не поцеловаться, то можно так навсегда и остаться друзьями.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Глава Сызраньской коммунальной службы называет себя Капитан ЖЭК Воробей.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Жена логопеда в постели лавировала, лавировала, да не вылавировала');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Кушайте, гости дорогие, кушайте. А если совсем совести нет, то и завтра приходите!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Мальчик-извращенец прочел Деду Морозу с табуретки всего Пастернака.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Машина не роскошь. Роскошь - средства на её передвижение.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Объявление в секс-шопе: "Журналы листать двумя руками!"');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Мальчик курящий «Приму», к сорока годам слесарь.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Депутаты Госдумы расширили уголовную ответственность за разглашение гостайны. Теперь заявление, что нами правят идиоты, будет караться как госизмена.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Трое в лодке, нищета и собаки.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Пришла беда откуда не ждали: медведь напал на представителя Единой России.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Бесплатно поyчаствyю в рекламе пива. Меньше 10 дyблей не беспокоить.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('После каждой победы в программе "Своя Игра" Анатолий Вассерман пришивает к жилетке еще один карман.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Надпись на стене в подъезде говорила о Кате намного больше, чем её статус во «ВКонтакте».');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('"Не верю", - кричал Станиславский, но его баня действительно горела.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Надпись на продукте «Маdе in Vеlikоbrуtаniа» вызывает у меня некоторые сомнения...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Геннадий Малахов учился целоваться на девушках, чтобы в совершенстве делать это на помидорах.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('На конкурсе детских рисунков мелком на асфальте победил Вовочка, нарисовавший простой круг. Остальных забрал Вий.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Поступая учиться на таможенника, я думал, что 6 человек на место - это высокий конкурс. И лишь по окончании учебы понял, что высокий конкурс - это 50 тыщ евро за место.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Школьница, сделавшая татуировку без спроса, получила дома ремнем чуть ниже бабочки.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Если вы считаете, что стали много зарабатывать, а рядом не появились женщины, значит у вас со словом "много" - что-то не так.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Увидев количество моих друзей ВКонтакте, мама сказала: «Нет, сынок, такую свадьбу мы не потянем!».');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Молодожены попробовали с солью и поругались.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Сын признался отцу, что он гей. Батя не знал как реагировать и заставил сына скурить блок синего Винстона.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Весной у медведя затопило берлогу, и он задрал работников ЖЭКа.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Магазин продуктов Бумеранг: их ешь, а они обратно.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('С конвейера АвтоВАЗа сошли с ума комиссии Опеля и Фольксвагена...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Чупа-чупс со свистком - отсосал и свисти.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('При покупке нападающего Жо, в пару в нападение к нему предлагался игрок Па, но ЦСКА не решился на такой креатив.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Выpажение "pадует глаз" пpидумали циклопы.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В ходе спецоперации Госнаркоконтроля было сожжено полторы тонны юмора.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Водитель БелАЗа смотрит на дорожные знаки просто из любопытства.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Гинеколог это просто сильно опустившийся ЛОР.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Многие знают, что собака Павлова при виде лампочки пускала слюни, но мало кто знает, что она могла вытворять при виде паяльника!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Недавно в кустах был найден скелет. Это был скелет чемпиона мира по пряткам.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Свет мой зеркальце... Молчи!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Лето… солнце… море… пляж... Дети… сумки… муж… багаж… Номер… койка… душ… галдеж… был ли отпуск - хуй поймешь…');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Чем туже завязан пакет с печеньем, тем злораднее хихикают продавщицы.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Из-за лихачества водителя моторной лодки пришлось пожениться двум незнакомым людям, катавшимся на банане.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Учителя математики бью тревогу. В пункте А закончились автобусы!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Если соседка часто заходит за солью-значит ее интересует и ваш перец!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('На упаковке из-под каши быстрого приготовления рекламный слоган: Съешь-ка кашку!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Очень злой мальчик при каждом падении звезды загадывал падение ещё одной звезды и за выходные уничтожил целую Галактику.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Его били. Над ним издевались. Ему наступали на яйца. Брюс Уиллис. "Крепкие Орешки" Скоро. В кинотеатрах Вашего города!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Утром у подножия горы три внимательных альпиниста нашли одного невнимательного.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Если на палку колбасы надеть презерватив, то у Вас будет защищенная докторская.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Все гости желали молодожёнам крепкого здоровья, счастья в личной жизни и лишь один дядя из Калуги не стал льстить паре геев.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Девиз русского преподавателя: "Каждой твари - по паре!"');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Объявление в детском саду: "Пейте, дети, молоко! Туалет недалеко!"');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Довольно странная зима. Более точный прогноз синоптики сделать не решились...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Спасибо тем людям, которые вошли в мою жизнь и сделали её прекрасной. И ещё, спасибо тем людям, которые вышли из неё, и сделали её ещё лучше.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('У человека с фамилией Запорожец – сердце снизу.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Людмила Путина сразу же подала на развод, когда узнала, что произошло с предыдущей царской семьей в России.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Очень сильный пациент в ответ взял в у врача кровь из носа.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В Украине красивую девушку называют "гарна дивчина", а чересчур красивую - перегарна.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В связи с отсутствием туалетной бумаги прошу завести в местах общего пользования книгу жалоб.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Гаишник остановил гаишника: как говорится не дать не взять...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Пловчиха Юля, чтобы тренер не заметил, что она забыла шапочку для бассейна, плавала без купальника...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Обидно, когда дождалась парня из армии, а он тебя из тюрьмы – нет.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Садомахохисты-сладкоежки развлекаются не только кнутом, но и пряником.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Милиционеры - оборотни не отражаются в зеркалах заднего вида автомобилей.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В детстве колобка часто пугали боулингом.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Чтобы помочь больному быстрей разработать руки после сложной операции, врачи запустили ему вшей.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Интересно, если поставить памятник голубю, это их хоть как-то остановит?');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Народная примета: Если в сортире сидит мокрый чеченец, значит прежде там побывал Путин.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Девочка - мальчику: У меня болит живот, Значит кто-то там живет. Если это не глисты, Значит, это сделал ты!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Созрел адский план: поливать лужи, которые остаются за котами, валерианкой. Пусть тоже мучаются, суки шерстяные.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Собака по кличке Новость нашла бомбу. Новость быстро разлетелась по всей деревне.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Туристическое агентство "Штукатур". За штуку долларов - в любую точку мира!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Объявление: Ищу работу. Забыл, где она находится.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Меня не удивило, когда одна моя подруга попросила у другой отвертку, но когда та достала ее из сумочки...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('А какие у нас экскурсии. Заводской парк, бар у вокзала и дискотека ОЦМ. Золотое кольцо переломов города Кирова.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Каждого, кто пойдет на нас войной сегодня, ждет 600 километров неприступных рвов, окопов и заграждений, называемых в народе словом дороги.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Художника может обидеть каждый, поэтому не стесняемся, подходим, в порядке живой очереди.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Маша всего на один день не дождалась своего парня из армии. Она, конечно, не дождалась бы его и раньше, просто шанс выпал именно на этот день.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Добраться до вершины не так сложно, как пробраться через толпу у её основания.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Тиха украинская ночь... но сало надо перепрятать!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Машинистов со слабым вестибулярным аппаратом не берут работать на Кольцевую линию.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Автомобиль отличается от общественного транспорта тем, что ты сам выбираешь дорогу, на которой стоять в пробке.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('На конкурсе женской логики победил генератор случайных чисел.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Очень жадная семья решила сэкономить на видеооператоре и запомнила свадьбу.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Женщины - самые нежные, милые, добрые создания на свете, особенно, когда им что-то надо…');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Если вам надоело быть хозяином у себя дома, заведите кота.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Сергей Зверев долгое время думал, что бычий цепень - это аксессуар.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Самые ужасные слова заканчиваются на "льник" - начальник, будильник, понедельник!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Для того, чтобы послать гинеколога, не обязательно материться. Достаточно сказать - иди работать.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('"Я не мог поступить иначе!" - с грустью объяснял дачу взятки отец абитуриента.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Cделал дело – гуляй смело, дело не сделал – гуляй бойся.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В Китае так много людей потому, что они пользуются китайскими презервативами.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Вино 1985 года выпуска раскрепостило Вику 1986 года выпуска.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Я настолько некоммуникабельный, что начиная разговор, уже представляю, как буду избавляться от трупа.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Жена Геннадия Зюганова до сих пор стоит в очереди за югославской стенкой.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('На заявление правительства что "покер-не спорт", игроки в покер расстроились, но по привычке вида не подали.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Прогресс сделал розетки недоступными для большинства детей, умирают самые одарённые.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('SMS: «Милый, я тут какую-то фигню приготовила. Купи сосиски на всякий случай».');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Группа «Звери» подхватила чумку.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Идиотский момент, когда ты подпеваешь песне на радио, а исполнитель постоянно путает слова.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Неверная жена 2 часа убеждала мужа в том, что под кроватью завелся бабайка.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Мальчик-дальтоник простоял на светофоре 12 лет.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Мальчик понял, что мама не получила зарплату и обманывает его, после того как в 3-м киндер сюрпризе подряд ему попался желток и белок.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('«Я не пойду на дискотеку, у меня «эти дни», - сказала девочка и продолжила косить сено.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Наша Таня громко плачет, потому что плачет в рупор.');
