INSERT INTO JOKES (JOKES_TEXT) VALUES ('В Бельгии от обезвоживания организма умер писающий мальчик!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Полиция, откройте!- а нахуя вы там закрылись?');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Парадокс: настольный теннис не относится к настольным играм.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Автоваз зарабатывает неплохие деньги, пользуясь тем, что его продукция имеет внешнее сходство с автомобилем.');
