INSERT INTO JOKES (JOKES_TEXT) VALUES ('Нобелевский комитет принял решение в дальнейшем премию за укрепление мира выдавать в тротиловом эквиваленте.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Массовые акции повиновения вновь всколыхнули Беларусь.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Смотри, на восьмом этаже целуются! ДА.. им бы бабу...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Беззубый бобёр сосёт деревья и макает их в чай.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В голландских сказках добро всегда курит зло.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('"Не айс!" - сказал Кай, вылезая из постели Снежной Королевы.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('На семейной фотографии мерчендайзера самые красивые дети стоят в первом ряду.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Рядовой Петров уснул в церкви. Как говорится, солдат спит, служба идет.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В семье бюрократов отец не смог собрать нужный пакет документов, чтобы поставить сына в угол.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Гоpилка - это не yкpаинская водка, это маленькая человекообразная обезьянка...');
