INSERT INTO JOKES (JOKES_TEXT) VALUES ('Ирония судьбы. Девушка с Украины поступила в театральное, но всю жизнь играла проституток.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Хороший собеседник - не только слушает, но и подливает...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Футболисты саратовского Сокола могут переходить в другой клуб только в Юрьев день.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Если коту на лапу прилепить наждачку, то он будет не только умываться, но и бриться.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('На соревнованиях по парусному спорту русские взяли золото, американцы - серебро, а сомалийцы - заложников.');
