INSERT INTO JOKES (JOKES_TEXT) VALUES ('Интересный факт: чем ближе на заседании ООН страна сидит к США, тем тише она говорит слово «нефть».');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Я зла не помню. Приходится всё записывать в черную книжку.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Скучно станет - звони. Буду рада видеть твой пропущенный вызов...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Опытные грибники собирают грибы только на обратном пути, давая им возможность ещё немного подрасти!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Знаете, почему ёжик сворачивается в клубок? Он носик в попке греет.');
