INSERT INTO JOKES (JOKES_TEXT) VALUES ('Сейчас котам в лотки насыпают наполнитель, а раньше клали газеты. Поэтому современные коты так плохо ориентируются в политической ситуации.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Если в глазах собеседника застыл интерес, значит, он перестал вас понимать.');
