INSERT INTO JOKES (JOKES_TEXT) VALUES ('Новый сорт конфет от российских производителей - Мишка на сервере.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Седой мальчик Коля точно знает, когда папа шутит, а когда змея настоящая.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Воспитанная девушка с незнакомыми мужчинами в постели не разговаривает.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Братья Кличко - атлеты по-киевски.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В России единственный запрещающий знак - бетонный блок поперек дороги. Остальные предупреждающие.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Оказавшись в центре внимания, вы рискуете стать крайним.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Чаще всего Алёшу в женщинах отталкивают руки.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Смотрите во всех кинотеатрах России. " Зенит-3SL. В поисках ГЛОНАССа."');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('На вооружение Российской Армии поступила новая ракета «Блинчик» системы «Вода-воздух-вода-воздух-вода-воздух-Соединенные Штаты Америки».');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В такой короткой юбке ты никуда не пойдешь! Ты слышишь меня, Игорь?');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Талант - это способность делать то, чему нас никто не учил!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Мальчик, упав со 2 этажа, сломал первый.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Если в лесу встретить рыжего медведя. Значит на него кто-то сильно испугался.');
