INSERT INTO JOKES (JOKES_TEXT) VALUES ('Эстонские женщины рожают уже взрослых детей.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Приебалты. Всего одна букваа звучит как характеристика.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Обидно, когда два человека любят друг друга, но не могут быть вместе, потому что один из них дура.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Я вся такая внезапная - подошла к холодильнику, чтобы съесть кусочек огурчика и внезапно СОЖРАЛА 5 КОТЛЕТ!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Не имеет значения, ответил ты «да» или «нет» на вопрос «боишься ли ты щекотки?» тебя всё равно начнут щекотать и мерзко хихикать.');
