INSERT INTO JOKES (JOKES_TEXT) VALUES ('Нахожу выход из любой ситуации! Удивляет другое: как я, зараза, нахожу туда вход!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Настоящий друг никогда не спросит: "Сколько?", а сразу сходит куда надо и принесёт две.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Отец охотник все-таки убил медведя. Мясо он оставил себе, шкуру подарил жене, а цирковой велосипед достался сыну.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Судя по мешкам под глазами на новой фотографии основателя Википедии, пожертвования за прошлый год он тупо пропил.');
