INSERT INTO JOKES (JOKES_TEXT) VALUES ('Я же тебе русским языком сказала: "Буду через 5 минут!", - что ты мне теперь названиваешь каждые полчаса?');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Истина - это событие, подтверждённое двумя соседками.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Запрещаю жить некрасиво!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Один кот может обоссать всё, кроме самого себя. Два кота могут обоссать абсолютно всё.');
