INSERT INTO JOKES (JOKES_TEXT) VALUES ('Группа умных альпинистов обошла Эверест.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Опытный ГАИшник может прочитать по губам слово "бляяяя" на любом расстоянии.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Повезло - это когда у твоей подруги на тесте 2 полоски, а она ни твоего мобильного, ни адреса не знает.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Неопытный водитель Антон, узнал еще 15 афоризмов на свое имя.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Завещание учительницы физики начинается со слова «Дано».');
