INSERT INTO JOKES (JOKES_TEXT) VALUES ('Маленький мальчик в зоопарке пролез в клетку со львом и протянул печеньку. Ну что же тут сказать, мальчик хотел покормить льва – мальчик покормил льва.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Отец не узнавал своего сына Василия, чтобы тот выорс богатым.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Жена Николая Валуева попросила сделать ей массаж. На «рельсах-рельсах, шпалах-шпалах» она еще держалась, но когда «поехал поезд запоздалый» уже не выдержала.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Дятел долбил берёзу и захлебнулся берёзовым соком...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Один из пассажиров Титаника заснул, когда садился на борт, а проснулся, когда его вынимали из шлюпки. Так сказать пропустил самое интересное.');
