INSERT INTO JOKES (JOKES_TEXT) VALUES ('Над залежами американской нефти геологами была найдена какая-то арабская страна.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Полярный медведь - это прямоугольный медведь после преобразования координат.');
