INSERT INTO JOKES (JOKES_TEXT) VALUES ('Мы с вами живем более менее сносно до тех пор, пока китайцы не поймут что рис - это всего лишь гарнир.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Из больницы сбежали люди с расстройством кишечника. Врачи быстро нашли их по горячим следам.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Учитель трудов пришел на урок трезвый и не знал, что рассказывать детям.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('ОАО "РоссНефть", ОАО "Газпром", ЗАО "ГИБДД".');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Чем прекрасны новогодние праздники? Не надо напрягаться: захотелось супчика - разогрел холодец...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Я знаю - ты мне изменяешь, я подглядывал.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('После таких аномальных холодов слониха в зоопарке может родить мамонта...');
