INSERT INTO JOKES (JOKES_TEXT) VALUES ('У родителей, которые воспитывают ребенка кнутом и пряником выростает толстый побитый ребенок.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Секрет - это то, что приходится всем рассказывать поодиночке.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Граф Дракула брился по памяти.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Саша и Коля гуляли по крыше. У Саши был Билайн, а у Коли - МТС… Саша упал с Крыши, а Коля не упал. МТС – на шаг впереди.');
