INSERT INTO JOKES (JOKES_TEXT) VALUES ('В женской сумочке нет только двух вещей - места и порядка.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Ваши волосы жирные в корнях и секутся на кончиках?! Не расстраивайтесь, посередине же они нормальные!');
