INSERT INTO JOKES (JOKES_TEXT) VALUES ('С первым ребенком родители кипятят все. Со вторым - просто ополaскивaют водой. Если у третьего ребенка собaкa отнялa соску, то это уже проблемa ребенкa, кaк отобрaть ее нaзaд.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Пистолетом можно ранить, а словом - убить. Особенно если это слово - "Пли!".');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В Лихтенштейне всего 2 полицейских: добрый и злой.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Хитрые лесорубы раскормили белку-летягу до 120 кг, чтобы самим не валить деревья.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В детстве человек–паук был обычным мальчиком. И даже то, что мама кормила его мухами не казалось ему странным.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Фразу «Молния два раза в одно место не бьёт» электрик Сидорчук уже не скажет никогда.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Тренер Барселоны заявил, что Реал ему сосьедад.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Президент Медведев издал указ, запрещающий называть его Владимиром Владимировичем.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Всех сделали из ребра, а Федора Бондарчука из колена.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Если муж засиделся в туалете, то достаточно сказать ему: "Милый, я пока пороюсь в твоем мобильнике."');
