INSERT INTO JOKES (JOKES_TEXT) VALUES ('Танк, выехавший на дорогу в Свердловской области, не нарушал ПДД.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Есть люди, которые обращаются к религии в поисках ответов. Но большинство используют для этого Гугл.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Тараканы не исчезли, они разбежались по головам.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Чтобы утром не замарачиваться на "с какой ноги вставать", - просто падай с кровати.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Самый длинный лимузин в мире…сбивал пешехода на протяжении…трех часов.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Меню Макдональдса полностью совпадает со списком запрещенных препаратов антидопингового комитета.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Кого-то жизнь совсем не учит. Беззубый мальчик до сих пор заглядывает во все замочные скважины.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Вызывает подозрение, когда отдыхаешь с друзьями на озере, и ни один за 6 часов ни сходит в туалет. Все только «купаются».');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Директор завода по изготовлению выключателей вообще не врубается.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Господи, как ты меня напугала.. На себя посмотри!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Спортсмен-дебил пришел на финиш первым, хотя должен был всего лишь толкнуть ядро!');
