INSERT INTO JOKES (JOKES_TEXT) VALUES ('В детстве родители били меня электрошокером, после чего заставляли писать сочинение на тему: Как я провел электрический ток.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Бывает скажешь себе: не пью, не пью, не пью, не пью! А тут бац! И пятница...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Лепщица пельменей потрепала сына за щёку и завернула ему лицо вовнутрь.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Сын Елены Малышевой боится признаться маме, что болеет.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Только русский человек на вопрос «Ты Куда?» отвечает «Ща приду».');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Ничто так не красит спящую женщину, как сидящий рядом маленький ребенок с фломастерами.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В 7 классе у Ани были веснушки, и она очень комплексовала. Потому что у всех была грудь, а у меня веснушки.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Найдя мужа для Валерии Новодворской, Лариса Гузеева поняла, что её миссия на Земле закончена.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Жена Владимира Потанина постирала вместе со штанами мужа контрольный пакет акций Северстали!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Дорогой, ну, купи мне шубу! - Откуда у меня такие деньги? - Любимый, у тебя же две почки, а я у тебя одна!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Если девушка говорит: "Я бyдy готова чеpез минyтy", это значит можно раздеваться и смотреть кино.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Зона для некурящих в кабаке - это как дорожка для несущих в бассейне.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('По данным Всемирного института незавершенных исследований, в семи случаях из десяти.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Студентка нашла удачное место для шпаргалки и кончила с отличием.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Уронили виски на пол - отрвали Кате руки...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('У таджиков обнаружен ген отвечающий за плитку.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Девочка с большим объемом легких, задувая свечи на праздничном торте, убрала со стола.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Предупредительный выстрел в голову.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Согласно исследованиям британских ученых, крольчиха никогда даже не успевает сказать, что у нее болит голова.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('По статистике, 99% мужчин отобьют мяч подкатившийся к их ноге. К сожалению, сборная России по футболу входит в 1 оставшийся.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Что общего у блондинки и наркомана? Периодически ломаются.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Сигнал SOS начинающая радистка поняла превратно...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Дима примерил круглые очки, и нечаянно для себя дал концерт вместо Аркадия Укупника.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Лучший секс, это с экс женой.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Витя до сих пор ест за маму, папу, дедушку и бабушку, потому что физически более развит.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Герда, где мое ледяное сердце? Прости, Кай, я ебанула его с вискарем...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('"Бе-бе-бе" - самый весомый аргумент в любом споре.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Мальвина на фоне голубых обоев кажется лысой.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В большой семье раздавались характерные щелчки.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Чемпиону школы по прыжкам в высоту теперь придется ремонтировать потолок в спортзале.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Жена в поте лица консервировала овощи, а муж, развалившись в кресле, любовался на этот закат.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В Иране запрещён алкоголь, поэтому там все помнят свой первый сексуальный опыт.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Я думаю, что столь нелогичен, потому что кактус вяжет красный сорок пять.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Три раза бросал старик невод в море, да так и не попал...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Вчера Николай Николаев был назначен чрезвычайным и полномочным послом в Швеции, Жнеции, Надуде и Греции.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Современная молодежь. Сереге было не по себе, когда Миша надевал его юбку.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Неожиданный сеанс невесомости произошел в парке культуры во время замыкания электричества на колесе обозрения.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Мужчина способен 2 часа сидеть, не шевелясь, смотреть на поплавок, а подождать 15 минут, пока жена оденется, у него нервов, видите ли не хватает!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Соседи совсем обалдели! Три часа ночи, по батарее долбят! Хорошо я не сплю, на гармошке играю!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Членистоногие – так ласково в наpоде называют наших футболистов.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('По утрам сантехник Сидоров впитывает влагу лучше любых подгузников.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Вышла новая туалетная бумага с дырочками! Туалетная бумага с дырочками - всё в твоих руках!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Ветер был настолько сильный, что кузнечику вывернуло ноги в правильную сторону.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Эфиопский сумоист весит 37 килограмм.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Смартфоны становятся все тоньше и умнее, а люди наоборот...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Сергей Шнуров предложил Хулио Иглесиасу ещё 15 вариантов его имени.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Пауло Коэльо пишет свои книги, используя статусы пятнадцатилетних разочарованных школьниц.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Денег, которые я заработал, хватит мне до конца жизни. Но при условии, что я умру сегодня в 15:00.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Антон всегда во всём старался быть первым, но из армии к своей девушке пришёл в лучшем случае четвёртым.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Прокурор сказал, следак сделал...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Баба Надя рубила дрова и зарубила деда, но ее оправдали, так как он был в дрова, могла и перепутать!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Бабушка Зина выпила 10 бутылок Ред була и задоила корову на смерть.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В секции выжигания по дереву требуется преподаватель, ученики и смысл.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Такого козла еще поискать надо. Но я-то умница, я-то нашла.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Доширак, теперь вилка в каждой пачке. Ролтон – вилка в каждой пачке Доширака, съел Доширак, не выбрасывай вилку, ешь Ролтон.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Руководство компании МТС боится сказать Николаю Валуеву, что он больше не будет сниматься в их рекламе.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Учитель физкультуры не пустил домой жену, потому что у нее обувь с черной подошвой.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Народная мудрость: девочку, у которой рот до ушей, нельзя поцеловать в щёчку.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('О том, что Катя не поступила в МГУ, первым узнал отец-дальнобойщик.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Вчера Туркменские хакеры впервые вышли в сеть! Двоих убило сразу. 220 В - это вам не шутки.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Как говорит в таких случаях мой психолог: Да пошли они все в жопу, уроды грёбаные.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Врачи-растаманы ходят в Бобо-Марлевых повязках.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Миша дернул Машу за косу и порезался.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Сосед сука! Я еду на рыбалку - он мою жену шпилит, я ночую дома - он мои сети проверяет!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Занимаясь онанизмом, Василий поливает рабочую руку бензином АИ-92, потому что на АИ-80 стучат пальцы.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('5-ти летний Женя целый день проходил голодный, потому что бабушка не знала как открыть стеклопакет, чтобы позвать внука кушать.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Американские университеты – это то место, где российские евреи преподают математику китайцам.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Новинка сезона! Зеркало со встроенным фотошопом.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Етти нашедший бритвенный набор, мерзнет.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Четыре часа ночи. Звонок в дверь. Муж открывает - на пороге жена: пьяная в хлам, колготки порваны, в одной туфле. Муж: "Я тебя в таком виде домой не пущу" Милый, я за гитарой.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('У меня есть два типа настроения: Похуй и иди нахуй.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Бутылка водки даёт фрезеровщику + 4 к смелости и - 3 к пальцам.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Студентка ПТУ влюблена в попугая потому, что с ним есть о чем поговорить.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Андрей Губин напился и устроил драку в мини-баре.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Директор завода «Фольцваген» - тот ещё жук.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Трупы в крематорий поступают в порядке живой очереди.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Цирк примет на работу ещё 10 воздушных гимнастов.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('У мальчика объевшегося мороженым не только слиплась, но и замерзла.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Удивительный случай: девушка из Украины приехала в Москву, не поступила, уехала домой, подготовилась, и поступила.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Настоящий лидер  должен быть всегда позади. Это вам объяснит любой пастух.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Что русскому хорошо, то... после 22-00 не купишь...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Ученик пятого класса специально забыл дома и дневник, и голову, чтобы учительница не смогла пошутить.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Акция! Купи пять тестов на беременность и получи блок Марлборо в подарок!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Срочно требуется «Фейри» третьей группы, резус фактор положительный. Губка- боб в опасности.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Услышав фразу: "Но я ведь женщина!!!", понимаешь – аргументы у неё закончились и в ход пошли козыри.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('У Вячеслава была самая красивая девушка в округе, поэтому в армию его провожали всем двором.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Если колорадский жук сидит снизу листа к дождю, а если сверху - САМЕЦ!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Никогда не называй человека дураком. Лучше возьми у него в долг.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Негры не краснеют и не бледнеют, поэтому такие наглые.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('- Я вчера между двумя Аньками лежал, желание загадывал… Сразу исполнилось!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Слышали, как вы по телефону разговариваете: «Ага, добро! Ага, добро!». Можно подумать вас там спрашивают: «А бабушку через дорогу перевести - это добро? Ага, добро!»');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Друг вчера купил таблетки для улучшения памяти, сегодня забыл куда их положил.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Муж Елены Берковой говорит своим детям, что их мама - лётчик.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Дело не в тебе, дело во мне! Ты же не виновата в том, что мне не нравятся скучные, толстые девки…');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Плохо расчерченная трасса явилась причиной перестрелки биатлонистов с пограничниками.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Девушка приехала поступать в Школу милиции, не поступила, стала путаной и через полгода все-таки поступила в милицию.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В музее восковых фигур, во время пожара, удалось спасти только пол Мадонны и два ведра Сталина.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Никогда не смеши человека, который жуёт печеньку… подожди, пока он начнёт запивать её чаем!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В ночных клубах после двух часов ночи начинаются дикие пляски пьяного неликвида брачного рынка.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В селе горе! Самогонщица баба Дуся... со своими подружками ЕДЕТ на ЕВРОВИДЕНИЕ.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Проспал 11 часов и не выспался. Я такой ненасытный в постели.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Не ставьте будильник на «круглое» время. Вы выспитесь лучше, если он зазвонит не в 7:00, а, например, в 11:48');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Единственный человек в Урюпинске, который может позволить себе ездить на ягуаре – это сторож зоопарка.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Ни дать, ни взять! — ангина во время менструации.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Нигде так не любят российских туристов, как нигде!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Девушка, которая тихо просит об остановках в маршрутке, знает город лучше таксистов.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('О, эти удивительные родительские собрания. Вход бесплатно, выход 250 рублей.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Учеными доказано, что на очень прыщавую девочку не стоит давить.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('На рынке в Одессе: продаются котята - 5 гривен ведро!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Девочка-доширак разводится за 5 минут.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Небрежно забытые на поле грабли, остановили проход по флангу Криштиано Роналду.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Позитивный человек - это тот, кого послали на хуй, а он оттуда вернулся отдохнувший и с магнитиками.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Ни кола ни двора - импотент без квартиры.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('На видео краш-теста Лады Калины видно, как манекен плачет и пытается кому-то позвонить.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Блин! При попытке поработать, снова был обнаружен интернет.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('После подробного осмотра сотрудники милиции решили, что либо, его 27 раз ударили ножом, либо один раз, но большой и острой расческой.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Через год у России закончатся запасы газа и нефти, сообщил советник Президента по панике.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Бедные дети, как же они смогут драться на переменах электронными книгами...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Мальчик, у которого нет игрушек, накачал грудь, чтобы играть мышцами.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Если ты уже вышла замуж за нефтяного магната, купила себе виллу в Ницце и выиграла в лотерею миллион фунтов стерлингов, это значит, что скоро прозвенит будильник.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Когда же, наконец, в России снова появится настоящее хорошее грузинское вино? Когда? Когда... Когда Онищенко на горе свистнет!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Новый орбит со смещенным центром тяжести: вкусно справа.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Сегодня многие согласны: отключение интернета можно считать концом света.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Алкоголь убивает клетки мозга, но не все, а только те, которые отказываются пить.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Жители Африки стали более цивилизованными.  Они убивают зебр и переходят по ним дорогу.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Игрокам сборной Андорры по футболу, чтобы перейти на половину поля соперника, требуется получить визу.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Новые сигареты для школьников «Родительское Sobranie», теперь со вкусом ремня.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Российский гонщик Виталий Петров после гонки, на всякий случай, уносит аккумулятор домой.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Символ времени - кредитный Айфон с тарифом "Перезвони!"');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Хочешь провести незабываемую ночь? Прими роды.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('На медальном заводе выдали зарплату продукцией. Вечером по домам расходились грустные мастера спорта, Чемпионы Европы и обладатели Кубка России!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Кто в Армии служил, тот в цирке не смеётся.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Не женское это дело - встречаться с модным российским певцом.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В российской федерации начали производить новые баллистические ракеты «Журавль». Министерство Обороны предупреждает: лучше синица в руке, чем Журавль в небе.');
