INSERT INTO JOKES (JOKES_TEXT) VALUES ('Добрая и сильная девочка насмерть закидала утку хлебом.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Не демонстрируй людям свое счастье - не отравляй им жизнь!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Кошки никогда не опускаются до того, чтобы уставать как собаки.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Не бери на себя больше, чем на тебя уже навалили.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Мама, провожающая сына в армию, может разогнаться по перрону до 50 км/ч.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Неопытный вор-карманник довёл свою жертву до оргазма.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Лучше один раз родить, чем каждый день бриться...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Директор завода по производству вазелина в очередной раз ускользнул от налоговой.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Школьников, курящих за углом электронные сигареты, ловит не завуч, а учитель информатики.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Лёша так легко вливался в любой коллектив, что сам не заметил, как спился.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Приговор "18 лет лишения свободы с постепенной конфискацией имущества" вынес гражданке Сидоровой тест на беременность.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Оркестр МВД раскрыл преступную схему производства фальшивых нот.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Что делают находчивые девушки, чтобы запомниться парням на всю жизнь? Залетают.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('И жили они долго и часто.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Дезодорант не всегда правильно работает и вместо парней на вас налетают мухи.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Ученые выяснили, чего хочет женщина. Но она уже передумала!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('СОВЕСТЬ у нас чиста - мы ей не пользуемся!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Дальтоники видят синий свет в конце тоннеля.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Без окон без дверей: автомобиль ВАЗ выглядит куда безобиднее.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Я довольно хуёвая натура, но вы привыкните...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Если вы бисексуал, то шансы хорошо провести вечер увеличиваются вдвое.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Сегодня прыгаю с парашюта, завтра расскажу об ощущениях. (статус обновлен 84 дня назад)');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('По-моему, я беременна: меня тошнит от работы и тянет на солёное море.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Компьютерный вирус, это враг или друг? Это кормилец! (Евгений Касперский).');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('У воды есть 4 агрегатных состояния: твердое, жидкое, газообразное и арбуз.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В кинотеатр надо брать мясо и кидать в зрителей. Представь - страшный момент и тут тебе мясо в руки падает.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Людоед пленникам: На первое, второе, третье - расчитайсь!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Охранник - уникальное существо. Всегда охраняет то, на что никогда не заработает.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Опять сломалась моя "Ока". Пришлось ехать в автобусе с чернью.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Такое ощущение, что у меня в голове стоит будильник, заведённый на 11 часов вечера, с напоминанием: Не забудь пожрать на ночь!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Деньги надо пОтом зарабатывать: Вспотел - получил! Не вспотел - не получил! Вагон с углем разгрузил на морозе - не вспотел, не получил!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Никогда не спорьте с женщинами, ведь они всегда не правы!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Черепаха Тортилла вручая ключик Буратино, томно прошептала "триста восьмой".');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Всё новое это хорошо забытое старое. Именно так у меня появляются новые вещи.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Перебирал семейную аптечку. Судя по ней, у нас 2 цели в жизни - успокоиться и не обосраться.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Букетно-конфетный период - это когда они с подружками еще не решили, надо ли ей это, а ты уже потратил на нее 83 зарплаты.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Ребенку подарили набор доктора. У кота началась новая жизнь с трудноизлечимыми болезнями!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Телеканал "Рябь"- мы работаем всегда!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Никотин вызывает зависимость. Никотин вызывает зависимость. - Зависимость слушает, приём?!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('После развода с женой, Василий в одиночку воспитывает и растит пивной живот. А по выходным даже катает его на каруселях.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Работники лакокрасочного завода возвращаются домой через сказочный лес.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Человек с очень слабыми ягодицами непригоден под 90% свадебных конкурсов.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('На белом белом покрывале января, сильной струей ее я имя написал, не подведи меня мороз, хочу доделать я сюрприз, на белом белом покрывале желтых брызг...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('"Вот вам горячая вода", - орали пожарники, разгоняя митинг бабушек перед зданием администрации.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Групповуха недаром пишется с двумя П и одним Х...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Отдам даром шарф "Зенит-Чемпион!" Причина: пошли они на хуй!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Хочешь, я научу тебя летать? Может, не стоит - все-таки 300 пассажиров?');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Фотография девушки привязанной к дереву гласит - правильно зафиксированная девушка в предварительных ласках не нуждается.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('- Чай!!! Наконец-то чай!!! — радостно закричала печень... и упала в обморок.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Ямы на дорогах стали причиной случайного секса в маршрутке.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Привычка – страшная сила. Бабушка, когда листает фотографии на айфоне внука, слюнявит палец.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Постоянные упреки «Будь проще», довели Диму до состояния инфузории туфельки.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('А чего мне бояться? - подумала Красная шапочка. Лес я знаю... Секс люблю...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Как говорила одна забывчивая путана: «Собственно, почём это я?»');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Сантехник Сидоров прослыл в ЖЭКе интеллигентом после того, как на вопрос "кто-кто?" ответил: "Агния Барто!"');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Когда ты делаешь умный вид, то у тебя очень глупое лицо!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Я слышал, что на вашем последнем альбоме вы сделали огромный подарок всем фанатам. Диск не читается.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Учитель труда обычно вызывает родителей ученика сразу за школу.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Она была романтичная, но своеобразная натура, поэтому всю жизнь ждала чёрта на чёрном козле.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Бабушка, которая вяжет во сне просыпается в шерстяном коконе.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В маршрутке было холодно, и чтобы хоть немного согреться, Андрей разжег межнациональную рознь с водителем Арсеном.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В Голландии ботаниками называют самых популярных учеников школы.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Родители часто ставили Сережу в угол. Они не хотели, чтобы гости видели дыру в стене.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Петрович выбежал и стал отстреливаться от танков... Вовремя подоспели санитары, иначе бы танкам хана.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Учитель пения, принимая перед каждым уроком по 50 грамм коньяка для связок, к шестому уроку превращается в трудовика.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В отличии от собак, кошки-повадыри помогают слепым лазить по деревьям.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('У Мойдодыра одна нога здесь, другая таз.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('К побережью США приближается новый сверхмощный ураган. Ему уже присвоена наивысшая степень опасности и звание Героя Российской Федерации.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Клавиши Ctrl, C и V с ужасом ждут 31 декабря.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Чтобы хоть как-то отвлечь внимание от дырки в носке, мальчик Петя ударил именинницу табуреткой.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В молодости мы верим всем, но никто не верит нам. В старости все верят нам, но мы - уже никому.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Хозяева квартиры были очень удивлены, когда установщик пластиковых окон снова позвонил в дверь.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Труд сделал из обезьяны уставшую обезьяну.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Надпись на могиле математика: «Что и требовалось доказать».');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Обычно я не решителен, но сейчас я в этом не уверен...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Иногда мой кот смотрит на меня, как бы говоря: "Вот я - кот. А чего добился ты?"');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Никому нельзя верить, даже себе, ведь только пукнуть хотел - думал Дима отстирывая трусы.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Рыбацкое наблюдение: хорошая палатка горит со скоростью 100 баксов в секунду.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В мире хищников всегда виновата жертва.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('У бабушки был крайне неудачный день: и вафли не получились, и ноутбук зря испортила.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Почему кошки и собаки вылизывают себе яйца? Потому что МОГУТ!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Российскaя особенность - укрaсть нa строительстве дорог, купить нa них дорогую мaшину и рaзбить ее о плохие дороги.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('С появлением интернета вопрос "как убить время" не актуален. Актуален вопрос "как выспаться за пару часов".');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('4 чёрненьких, чумазеньких чертёнка... Ищут пятого, чтобы играть в НБА.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Фоторобот маньяка, сделанный одинокой женщиной, вогнал в краску все отделение.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Отец Фёдор решил построить храм в ипотеку, и потерял веру.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Сын сценариста "Пилы" - самый мотивированный ребёнок в мире.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Вчера вечером в подворотне девушку-логопеда маньяки насиловали, насиловали, да не вынасиловали.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Вчера в лаборатории одного из НИИ методом научного тыка было получено удовольствие.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Теперь в Америке нужно говорить афроамериканец, в России – выходец из Африки. Только в Нигерии все остается по-прежнему – «Эй, ты».');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('На изготовление плакатов певицы Лолиты каждый раз расходуется пять фотошопов.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Всех свадебных фотографов надо сжечь на большом костре. Всех, кроме одного - он пусть сфоткает как будто я держу костер на ладошке.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Вы имеете право хранить молчание. А всё, что вы скажете, будет искажено, извращенно, и направлено против вас.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Богатый человек может находиться одновременно в нескольких местах. Например, в санатории и в федеральном розыске.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Группа геев отказалась вступать в Единую Россию, мотивируя тем, что не настолько же? они пидорасы.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Сошлись, как-то, Илья Муромец и Соловей-разбойник, но церковь была против этого брака.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Правая рука была у него рабочая, а левая рука была просто правой.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Сомалийский пират находясь в больнице захватил чужое судно.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Если ласточки низко летают, значит они объелись.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В ДНК человека забралась ошибка. К хромосомам X и Y прибавилась хромосома Й.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Все программы в телике по возрасту пометили. И теперь дети точно знают, какие передачи самые интересные.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Нобелевскую премию в области медицины получил учёный, научившийся оживлять людей. Альфред Нобель лично поблагодарил его за вклад в науку.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В камере, заключённый по кличке «Енот», внезапно стал «Крошка Енот».');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('У Брюса Ли был брат скептик. Его звали Вряд Ли.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('С официальным визитом в Кремль прибыл Леонид Агутин, но было закрыто.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Фильм «Женщина-кошка» Юрий Куклачев прячет на верхней полке за одеждой.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('На днях сдавал тест на наркотики, и он оказался отрицательным. Теперь нам с дилером есть о чём поговорить.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Старенький дедушка так поперхнулся, что накачал пресс.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Скорость звука - странная штука. Родители говорят тебе в 20 лет, а доходит только к 40.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Первокурсник Николай случайно застал своего декана в объятиях заведующего кафедрой и уже к вечеру закончил магистратуру.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Вчера из сельпо «Костеновки» были украдены деревянные счеты и другая орг. техника.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Одноклассники - страшный сайт. Ко мне просятся в друзья натяжные потолки, шторы, шкафы… Наверное в параллельном классе учились.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В постели можно делать всё, что доставляет удовольствие обоим. Даже читать.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Бегут два муравья и поют:" Нас не догонят". На одного наступили, второй: "зачем топтать мою любовь"');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Выпил я вина бутылку и пописать вышел в поле…надавали по затылку - дело было на футболе!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Для мужчины раздеть и не трахнуть, все равно, что для женщины померять и не купить!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Мальчик качался на табуретке, упал и сломал все 6 ножек.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В жизни надо попробовать все. Главное — не начинать с интернета.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Июнь. Отключили Интернет. Пойду хоть ёлку выброшу, что ли...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('sms: Привет, пойдёшь бухать? Мы тут набрали несколько ящиков выпивки! Ответная sms: Бля, конечно пойду! А кто это?');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Есть такая категория соседей: перфорасты');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('ЧП в российских ВВС: чтобы хоть как-то подзаработать, российские лётчики бомбили по ночам.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В семье потомственных качков через 3 поколения голова отмирает как атавизм.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Надпись под стоп - краном в поезде метро: Если ехать стало лень, дерни эту поебень.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Если размер не имеет значения, почему никто не производит семисантиметровых вибраторов?');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Черепашка - промежуточное состояние между яйцом и пепельницей.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Разнорабочий Василий, с трудом совмещает работу бухгалтера, пекаря и космонавта.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('У работников Автоваза на пальцах не подушечки, а ягодички.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Водители часто недооценивают помеху справа. Особенно ту, которая сидит рядом на пассажирском кресле справа и постоянно что-то пиздит...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В СССР секса не было, поэтому после прелюдий люди, как-то, тупили, не зная, что делать.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Фраза "Милый, подай, пожалуйста, цветные невидимки" напрочь убила мужскую логику.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('«Так-то, я Alpen Gold люблю» - сказал чиновник, задвигая пачку денег в шкафчик.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Посмотрев на прошлой неделе фильм "Ирония судьбы или С легким паром", половина россиян инстинктивно отметила Новый Год.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Cерьезные отношения - это не когда секс. И не не когда штамп в паспорте. Серьезные отношения - это когда они вместе берут ипотеку.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('У Дарьи Донцовой неровно стоял шкаф и она написала под него книгу.');
