INSERT INTO JOKES (JOKES_TEXT) VALUES ('Официант так сильно выслуживал перед посетителем, что даже не заметил, как начал тереться о ногу клиента.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В Китае нет понятия "изменил". Есть понятие "перепутал".');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Первому дагестанскому гею жмут стринги, а ведь раньше ему жали руку.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('После тридцати шанс выйти замуж есть... Но вряд ли.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Раньше я много пил, курил, употреблял наркотики, но потом доктор Курпатов сжалился надо мной, и выписал меня из больницы.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Девушки, сегодня Хэллоуин, можно не краситься.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Женщина способна вынести всё, а мужчина - ещё и ведро!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Когда в семье только одна жена, она вырастает эгоисткой.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Хорошему боксёру диссертацию защитить легко. Вот написать - трудно...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Лучшим противозачаточным средством 2011 года признана ипотека, второе место прочно удерживает новая иномарка, взятая в кредит.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Интеллектуал - этот тот, кто знает с десяток занятий поинтереснее секса.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Алло! служба спасения?! ПОМОГИТЕ! Мой друг накурился, сел в стиральную машину и... уехал...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Увидев счёт за коммунальные платежи. Действительно понимаешь, что темнота - друг молодежи.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Работая в Москве кондуктором, житель Монголии до сих пор думает, что он собирает с русских дань.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Плохую тетю надо бить по попе... животом...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('После долгих лет работы в ресторанах Михаил Шуфутинский рефлекторно начинает петь, когда видит кушающих людей.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Только в России заборы делают из досок, а мебель из опилок.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Жила-была обыкновенная шведская семья: мама, папа, брат, сестра и Малыш, который хотел собаку.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Чем меньше у фрезеровщика пальцев, тем он внимательнее.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В Царь-пушке живет царь-бомж.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('У Веры Брежневой начали срастаться брови.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Наркодилеры Урюпинска посчитали городскую акцию "Город без наркотиков!" криком о помощи, и утроили поставки.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Дедушка Анатолия Тимощука был лучшим бомбардиром на Евро 42-45.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Гинеколог меняет женщин, как перчатки.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Лучше плохо, чем никогда.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В завещаниях двадцать первого века будет очень много логинов и паролей.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('На чемпионат мира по сумо собралось более 80 тонн спортсменов.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Русская девушка поехала в Китай, и действительно убедилась что все мужчины одинаковые.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Такое ощущение, что соседи даже обои клеят перфоратором.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Тело в тело - милое дело!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('На свидание он пришел в своих лучших прыщах...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Всем девушкам, ждущим принца на белом коне, сообщаю!!! Конь сдох, иду пешком, поэтому задерживаюсь.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Все сомнения в добропорядочности Ирины развеялись, когда она на Новый год за пять секунд почистила во рту мандаринку.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Супермаркет «Балабол» - у нас самые самые-самые низкие цены.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('""Пончик, пончик!" - дразнили дети Колобка, не подозревая, что он серьезно ранен.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Рублевская моль близка к попаданию в Красную книгу, она гибнет от ожирения.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Трофейный «Шмайсер» деда Тихона доказал скинхедам превосходство вологодской расы…');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Построили баню! А через дорогу - раздевалку...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Первокласснику Ивану не доверили покупать цветы на юбилей бабушке, потому что четность и нечетность проходят во 2 классе.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Человеческая глупость дает представление о бесконечности.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Когда аист принес меня родителям, они долго смеялись и даже сначала хотели взять аиста…');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Маляр начал красить в коридоре, а закончил в фиолетовом лесу, собирая перламутровые подснежники.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Продавщица нижнего белья с 7 размером груди еще не разу не слышала фразу примерно как у вас.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Маленький Миша Прохоров в начальной школе увлекался модельками.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Правило любого провинциального городка: бывшая твоего бывшего - моя бывшая.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Михаил Булгаков по профессии был врачом, а прославился как писатель. Вот что получается, когда у врача разборчивый почерк.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Начальник пасеки никогда не мог определить по лицу, бухали его сотрудники или работали.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Батюшка, а я правильно живу? Правильно, сын мой, но зря.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Ох, и радовался очень жирный мальчик, когда мама купила ему очки. Потому что прозвище очкарик по любому лучше, чем жиробас.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Чудеса случаются. Это вам любой программист скажет.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('У работы есть три плюса: пятница, зарплата и отпуск.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Женщины - слабый пол. Например, зубную пасту они считают закончившейся на 3-4 дня раньше, чем мужчины.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('- Пааап, а мне сегодня сказали, что я невоспитанный! - Надо было на хуй послать!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Только в России президент может объявить 2013 год — годом семьи и развестись.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Актуальность моей дипломной работы состоит в том, что без неё мне не дадут диплом…');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Жанна Агузарова одевается в магазине Икеа.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Мальчик умевший перемножать в уме восьмизначные числа, никак не мог использовать этот навык в бою.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('У моего знакомого есть странный талант. Он находит вещи раньше, чем кто-нибудь успеет их потерять...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('После недельной голодовки лев, наконец, признал, что сторож зоопарка - царь зверей.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Пиар всегда пиар: путаны, засветившиеся в передаче «Дежурная часть» берут в полтора раза больше.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Почему бы и не сходить, когда тебя за волосы куда-то тащат.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Задержан учитель-садист. Он ставил своим ученикам единицы не только в школьном журнале, но и под их фотографиями на «Одноклассниках».');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Прогуливаясь ночью по парку, я встретил вызывающе одетых гопников. Камень – вот, что сразу бросилось мне в глаза.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Количество корманов на жилетке Вассермана равняется корню квадратному из его года рождения.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Мальчик не прибирался в комнате, пока не споткнулся о бомжа.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Дима женившись на стрекозе не предполагал что его дети будут личинками!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В Питере живут настолько интеллигентные девушки, что в постели от удовольствия кричат: «Есенин! Есенин! Есенин!»');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('А ведь жизнь после 50-ти только начинается! - подумал я и налил себе ещё 50.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Услышав на утро фразу: «Дорогой, я – беременна» Никита еще двое суток притворялся спящим.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В Голландии будет установлена новая статуя – хихикающий мальчик.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Девушка одуванчик - где нашел там и вдул.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Мужик поплавал в бассейне, заходит в раздевалку и обнаруживает: полотенце дома забыл. Сидит, обсыхает.... и ещё бы сидел, не попадись ему на глаза табличка "Занавесками не вытираться!"');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Если из Москвы вы шли пешком, то вы либо Ломоносов, либо очень не востребованная девушка с Ленинградского шоссе.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Женщина! С одной стороны это нежное, прекрасное создание! А с другой стороны у нее копчик!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Просто расписывая ручку, можно подделать подпись человека по фамилии Ишишин.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Меня бесит, что я всегда спокоен.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Кто на свете всех смелее, всех прекрасней и умнее? Риторический вопрос, если дуло смотрит в нос!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В Ростове уроки чистописания проходят не по правилам, а по понятиям.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Королева, у которой слабо был развит вестибюлярный аппарат мало того, что никого не посвятила в рыцари, но и погубило все войско.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('90% мужей симулируют удовольствие от борща.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Из заявления: "Прошу уволить меня по собственному желанию. Но если можно, то оставить."');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Романтический ужин удался. Кровать сломали.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Вся прелесть подмышек в том, что они всегда под рукой!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Делая вид, что помогаешь ребенку в песочнице, можно без палева играть с совочком, ведерком и формочками.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Борода Вассермана проросла в зубы!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Ну, привет, УТРО... Ты само-то хоть выспалось, чудовище каждодневное...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Сеть супермаркетов «Закрыто»! «Закрыто» мы уже открылись! Когда у всех закрыто, «Закрыто» открыто. Открой для себя «Закрыто»!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В окне показались люди с факелами, а в дверях - пожарные. А это значит, нас ждет пенная вечеринка!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Парадокс. У девушки с именем Параша красивая фотография в паспорте.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Разговаривать с кошкой — это не паранойя. Паранойя — это когда боишься при кошке сболтнуть лишнего.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Парадокс на телевидении. Сериал «папины дочки» - снял маменькин сыночек');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Режиссер Михалков резал на кухне лук и замироточил.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Я всё чаще ловлю себя на мысли, что хожу на работу потому, что там есть Интернет, а в магазин - потому, что там есть пиво.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Я думала, что некрасивых людей не бывает, пока не примерила шапочку для бассейна.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Милиция Барнаула нашла верный способ борьбы с проституцией. Чтобы девушки не смогли приехать в сауну, им ставят манту.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Есть люди, которым не доверяешь настолько, что после рукопожатия пересчитываешь пальцы.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Мать объясняла пятилетнему сыну, откуда он взялся. А папа подслушал, узнал правду и бросил их.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Сынок, что случилось, на тебе лица совсем нет! Я всадник без головы.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Он так красиво врал, почти как прогноз погоды!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Предсказательницу сбил непредсказуемый водитель.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Разобрал, почистил и собрал мышку. Пришёл к выводу: какая-то грязь имела важную функцию.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Опергруппа вошла с обыском в квартиру замминистра МВД и заблудилась.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Света 17 лет скрывала от родителей свою беременность, пока сын не начал свистеть и тарабанить.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Во время ссоры в секс-шопе покупатель, ругаясь на продавца, перечислил весь ассортимент магазина.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('На ялтинском пляже дельфин спас человека, отговорив его кушать чебурек.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Когда Свете было 3 года, она бегала голышом по пляжу. Сейчас ей 30, но две бутылки шампанского помогают вернутся ей в детство...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Самый умный в мире человек... выводит пятна через тройной интеграл.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Дятел с хрупким клювом вынужден вылизывать дырки в деревьях.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Мальчик из очень бедной семьи шел по городу в северо-западном направлении со скоростью 5-7 метров в секунду.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Примета: если в цирке акробат перекрестился, значит, номер отрепетирован не до конца.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Летом Кутузов носил солнцезащитное очко.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Когда Никите Джигурде снятся кошмары, обсерается весь подъезд.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Московский завод по производству утюгов получил крупный заказ на изготовление детекторов лжи.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Дима больше не одевает смокинг когда идёт в зоопарк, потому что его часто путают с пингвином.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Александр Овечкин, чтобы уснуть, считает хоккеистов.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Архимед все время ходил голым, благодаря чему изобрел маятник.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Вы хорошо смотритесь вместе но новогоднее обращение придётся делать одному.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Татьяна Буланова сделала операцию по подтяжке слёзной железы.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('У каждой женщины помимо ребёнка, которого она родила, есть ещё ребёнок, которого родила свекровь.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Жираф — это лошадь, выполненная по всем требованиям заказчика.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Ольга и Максим, убегая от медведя по лесу, очень жалели, что купили именно малиновые презервативы.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Тепло ли тебе, девица? Тепло ли тебе, синяя?...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Меня очень насторожило, когда девушка предложила встретиться на станции метро «Динамо».');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Я могу кое-как понять театр одного актёра. Но вот супермаркет одного кассира — это перебор.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Для жены Валуева пословица бьет, значит, любит смертельно.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В Хельсинки в местах кругового автомобильного движения установили знаки "Не более 3 раз".');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Есть такие решения, после принятия которых, тараканы в голове аплодируют стоя.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Мухи с Кавказа называют друг друга «братуха-цокотуха».');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Футболисты сборной России на выездах всегда играют плохо, потому что разглядывают новые ворота.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Встречa выпускников. Вовочкa встречaет свою клaссную: Мaрь Ивaновнa, a помните я нa урокaх всякую херню нёс? - Конечно помню, Влaдимир Вольфович.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Поработав 10 лет в ЗАГСе, я поняла: понемногу разбирают даже ебанутых.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Программисты не умирают... они теряют память...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('У Валерии Новодворской месячные синего цета. По политическим соображениям.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('На свадьбе по залету украли невесту, и у жениха затеплилась надежда.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В России футболист больше чем футболист но ниже чем баскетболист.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Фирма ищет нового бухгалтера! И старого тоже!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('...Целый месяц ежедневно втирала в лицо омолаживающий крем... Как теперь быстро убрать мозоли с лица?!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('«Ока» - первая в мире машина с откидным низом!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('При виде его достоинства у неё от удивления широко открылся рот, и раздвинулись ноги.');
