INSERT INTO JOKES (JOKES_TEXT) VALUES ('Мои соседи слушают хорошую музыку, и неважно, хотят они этого или нет.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Пингвины - это ласточки, которые ели после 6 часов вечера.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Светская львица Ксения Собчак снялась раздраженной для журнала. "Невропатология".');
