INSERT INTO JOKES (JOKES_TEXT) VALUES ('Мало всё взять от жизни. Надо еще вовремя перевезти это всё в Лондон.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('На новогодней елке 13 пиратов, 15 снежинок и один мальчик в костюме точки G. Вопрос, когда его найдут родители и найдут ли вообще?');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Идет по дороге студент, а навстречу ему мужик, тоже пьяный.');
