INSERT INTO JOKES (JOKES_TEXT) VALUES ('Мальчик из Тюмени ковырял болячку и нашёл нефть.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Победитель всероссийской олимпиады по лингвистике не смог ответить на простейший вопрос в Южном Бутово.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В Дагестане в результате драки со стрельбой убит еще один скучный вечер.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Подзатыльник – это способ передачи информации из поколения в поколение.');
