INSERT INTO JOKES (JOKES_TEXT) VALUES ('"Вы думаете, это поможет?" - Спросила принцесса Несмеяна, затягиваясь.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В Москве найден уникальный человек – он смог построить дом без единого таджика.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Поехав с незнакомыми людьми на шашлыки, Света не сразу поняла, почему она не скидывалась.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Спящий ребёнок - это не только мило, но и НАКОНЕЦ-ТО!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Комар, укусивший алкоголика, потом ещё два часа рассказывал ему про свою жизнь.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Я вообще не понимаю, как человек весом меньше 90 кг. может иметь свое мнение?');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Помню времена: шел в магазин с 50 рублями, возвращался с 3 пакетами картошки, 2 хлебами, с пакетом молока и чупа-чупсом. А сейчас что? Понаставили видеокамер.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Старший экскаваторщик Сидоров сделал карьеру в карьере.');
