INSERT INTO JOKES (JOKES_TEXT) VALUES ('Наглость его не знала предела, производной и других элементарных функций.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('На все детские утренники Игорек ходил в картонной коробке. «А Игорек у нас сегодня кто? А Игорек у нас сегодня Тошиба».');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Крошка сын к отцу пришёл, И спросила кроха: Что такое интернет? И что такое плохо?');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('О Деде Морозе либо хорошо либо ничего.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('У денег два состояния - либо они начинают заканчиваться, либо заканчивают начинаться.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Будильник бесит в двух случаях - когда звонит и когда не зазвонил.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Он был настолько беден, что по праздникам баловал себя хорошей туалетной бумагой.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Мальчик, не до конца завязавший шнурки, не до конца сошел с эскалатора.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Валера пил в Турции так много, что смог пересечь границу по паспорту своего шарпея.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('овая реклама кока-кола в России:');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Мама, как мне жалко лошадок, что они не могут в носу ковырять.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Когда Бог увидел, что на АвтоВАЗе наконец собрали приличную машину, у него просто камень с души упал...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Мама шотландца не пускает сына на дискотеку в короткой юбке.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Человек человеку волк, а зомби зомби зомби.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Получая квитанцию за услуги ЖКХ, невольно задумываешься - почем там нынче автоматы Калашникова?');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Если вас топят соседи снизу, значит у них там ваще пиздос!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Как объяснить ребёнку, что 8 часов утра в выходной - это глубокая ночь!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Заработок проституток растет не по дням, а по часам.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Обрабатывая ранку сыну мама так сильно дула, что у мальчика слезала кожа.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Попка вашего малыша не просыхает? Перестаньте ей наливать!');
