INSERT INTO JOKES (JOKES_TEXT) VALUES ('На сходке трудовиков провинившемуся трудовику пробили фанеру.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Сверхоптимист — это тот самый парень, который даже находясь по уши в дерьме, не унывает, а игриво и задорно булькает.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Нашла недавно характеристику мужа с детского сада. Хорошо кушает, спит, гуляет! Прошло 35 лет, ничего не изменилось.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В Ивановской области безрезультатно завершилась забастовка врачей - выставленные требования так и не удалось прочесть.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Сергей Зверев как кофе. Казалось бы, оно, а нет, он.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Только бабушки у подъезда знают кто на самом деле убил Кеннеди.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Самое сложное — это смотреть в поздравительную открытку, читать её содержание и делать вид, что не замечаешь вложенных денег.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Девочки, зря вы в школе физкультуру прогуливали. Там учили через козлов перепрыгивать.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Когда Дракулу спрашивают откуда у него такой замок, он честно отвечает: "Насосал".');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В детстве физиолога Павлова укусила собака. Собачка укусила и забыла. А Павлов вырос и НЕ ЗАБЫЛ.');
