INSERT INTO JOKES (JOKES_TEXT) VALUES ('Если выпил граммов двести, выпить триста - дело чести!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Самая веская причина для отказа от курения, когда после "задержите дыхание" на флюрографии, впадаешь в кому.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Выговоров бояться - на работу не ходить!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В Австpалии скpестили кенгуpу и ленивца. Бедный звеpек уснул в пpыжке и pазбился.');
