INSERT INTO JOKES (JOKES_TEXT) VALUES ('Если вам в глаз попала мошка, не выковыривайте, а медленно заморгайте её до смерти.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Только в России, выехав на встречную полосу, можно получить удар в зад.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('У армянских тараканов кроме усиков есть волосы на брюшке');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('За выходные на Урале попались 26 пьяных водителей. Непонятно только как вся эта пьяная компания поместилась на один "Урал".');
