INSERT INTO JOKES (JOKES_TEXT) VALUES ('"Каков поп, таков и приход!" - сказал батюшка, забивая кадило коноплёй.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Учительница биологии перед уроком накатила, а потом плакалась, что все пестики - козлы!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Маша Распутина перед выборами сменила имя и фамилию. Теперь ее зовут Раша Запутина.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Судя по фразе Юрия Гагарина: «Поехали!», он точно не знал, каким именно способом доберется до космоса.');
