INSERT INTO JOKES (JOKES_TEXT) VALUES ('Скоро алкоголь так подорожает, что только богатый человек сможет позволить себе валяться бухим возле вокзала.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('73-летний Сергей Зверев из Перми ненавидит слово «совпадение».');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В детстве я боялся темноты. Теперь, видя свои счета за электроэнергию, я боюсь света.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('После ремонта батареи отопления сантехником дядей Колей, воспитаники яслей увеличили свой словарный запас в два раза.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Коньяк признан лекарством - всё, мужики, я на больничном!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Семьдесят процентов хитрости лисиц приходится на тупость куриц.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Работники Автоваза работают за копейки, и на них же уезжают домой.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('У меня кошка как хатико. А еще жратико, сратико и ссатико, спатико, оратико, ночьюспатьнедаватико.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Муж вернулся из командировки на день раньше и был уволен с работы прямо в собственной спальне.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Работаю так, что аж лошади оборачиваются.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Женщины правят миром. Например, желание одной невесты оправдать внебрачную беременность создало мировую религию.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Увидел в переходе пацана с плакатиком «Помогите не хватает денег на операцию». Жалко стало. Подошел, добавил запятую.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Правительство заявило, что оснований для повышения цен нет, поэтому цены будут повышать без основания.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Мы - русские, можем нарушать любые законы, кроме одного… Не ставить пустую бутылку на стол!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('На школьном выпускном в Таиланде королём и королевой бала стал один и тот же человек.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Отсутствие лжи в списке семи смертных грехов христианства как-то ставит под сомнение всю остальную концепцию...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Даже если вам очень нравится фраза "Самый лучший секс с тем, с кем хорошо и без секса", не взболтните ее с друзьями в бане.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Гадости надо делать с лучезарной улыбкой. Тогда гадости ещё гаже.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Иранская примета. Если дорогу Вам перешла бабушка с ведром урана, то это к обогащению.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Мне нравится вон тот бегун с красным шарфиком вокруг шеи… Это не шарф - это язык.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Мошенник отправил смс-ку с текстом «срочно положи на этот номер 500 рублей, потом все объясню» генералу ФСБ, и уже через полчаса лично объяснял, зачем ему понадобились эти деньги.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В женском аду все мужики геи, в мужском, кстати, тоже.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Это не день серый, это просто окна грязные.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Может ли девушка забереминить от тампакса? Да, если он сделан из армейского матраса.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Говорят, что ели человека укусит вампир, то он превращается в вампира. Так вот у меня с утра такое ощущение что сегодня ночью всех покусали бараны!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Сын Дмитрия Медведева поступил в МГУ. Конкурс был серьезный - 23 ВУЗа на 1 место.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Пьяный саудовский водитель не справился с управлением и съехал в Кувейт.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('У женщин не бывает лишнего веса. Это всего лишь дополнительные места для поцелуев.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Азартная мама близнецов пыталась показать, что любит детей одинаково, но одна неудачная партия в покер всё решила.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Безногий мальчик экономит на бахилах.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Места для пассажиров с детьми, инвалидов и лиц с планшетами.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Фарш невозможно провернуть назад!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Очень пьяный игрок в покер блефанул прямо на игровой стол.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Сколько живу, не могу понять двух вещей: откуда пыль берется и куда деньги деваются.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Нетонущие какашки в унитазе любимого человека - это трагедия для любой молодой пары, которая только недавно начала втречаться.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('На воре мигалка горит.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Мало кто знает, но трудовики пьют, потому что так написано в технике безопасности, хотя этот пункт подписан ручкой.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Если в Оке пристегнуть ремень безопасности, то получится рюкзак.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Если в начале было Слово, то в конце, очевидно, будет Смайлик.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Продавщицы ларьков, идя домой с работы, некоторое время пугаются, видя людей целиком.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В мире не существует ни одного законченного натюрморта «Холодное пиво с крупными дымящимися креветками».');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Таджикские ученые доказали, что Джона Кеннеди убила пуля.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Многих женщин оральный секс устраивает... Причем, на довольно приличную работу.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Сенсация! Оказывается, братьев Запашных в начале карьеры было гораздо больше.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Я уступил дорогу Ладе Калине, и она рассыпалась в благодарностях.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Бабка которая откладывала деньги на черный день, в солнечное затмение нехреново оттянулась...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В Голливуде начали снимать порно в жанре детектива: до конца фильма непонятно кто кого.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Сотрудницу "секса по телефону" изнасиловали с неопределенного номера.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Девочке с лицом Сильвестра Сталлоне разрешено на уроках сидеть с зубочисткой.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Ничто не забыто, никто не забыт: Сергей Мавроди нет-нет, да и получит на улице пендель.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Интересно, а есть ли в Эстонии скороговорки?');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Лучшим противозачаточным средством 2012 года признана ипотека, 2 место прочно удерживает новая иномарка, взятая в кредит.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Дисциплинированный человек выдернул шнур, выдавил стекло и остался на месте, не зная что делать дальше.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('На Земле нельзя ничего украсть. Можно только переместить.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Увидев падающую звезду, девочка не успела полностью загадать желание, и теперь она все время хочет.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Из-за типографской ошибки на табачном заводе, теперь по стране гуляет партия «Marlboro» с надписью «Куряне убивают».');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Мальчик из очень бедной семьи поступил в музыкальную школу по классу ладошек.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('На концерте группы «Король и Шут» два бомжа затерялись в толпе фанатов.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Мнения супругов могут иногда не совпадать, что всегда и происходит.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('По гороскопу Свете общение со Стрельцами было противопоказано, но против банки Ягуара не попрёшь.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Тем временем, в Оренбурге до сих пор модно быть диджеем.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Жительница города Тольятти, вышла замуж за механика, родила шестерню.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В связи с кризисом свистеть в банках запрещено.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Курьез на программе "Смак": плохо прожаренная утка успела переварить яблоки.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Я не могу ударить женщину. Потому что вдруг она сильнее.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В футболе чем ближе конец, тем больше команды боятся за свое очко.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Лучшее пожелание парапланеристам – «Чтоб у Вас все сложилось!»');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Минздрав предупреждает: курение вызывает маршрутку!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Молдавские шаманы отремонтируют квартиру по фотографии.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Ликёро-водочный завод выпустил отрывной календарь... С пробниками на каждой страничке.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Самое полезное, что я сделал на работе за последнее время – смазал дверь, чтоб не слышно было, как я ухожу на час раньше.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Учитель ОБЖ поджигал школу со словами: «Я докажу, что это не мне, а вам нужно».');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В результате спецоперации МВД, в песочницах Москвы были задержаны десятки несовершеннолетних участников акции «синее ведёрко».');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Хитрый отец, чтобы скрыть трещину в углу, поставил туда сына.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Воодушевлённый переходом Роберто Карлоса в «Анжи», Онопко всё-таки рискнул и перелез через забор на Олд Трафорд!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Лучше сделать и жалеть, чем мучиться и терпеть до своей остановки.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Почему-то большинство людей считает, что они хитрее моего ружья.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Новый электрошокер от компании Apple - iБлять!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Первое занятие на курсах сантехников начинается с фразы: «Забудьте всё, чему вас учили порнофильмы!»');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Женщина, которая работает на почте России, не всегда доставляет мужчине удовольствие.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Я живу в ста метрах от аэропорта рядом с железной дорогой - нахера мне бесшумная стиральная машина?');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Иван не искал простых путей, поэтому зубы чистил через задницу.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Камасутра изначально была пособием по греко-римской борьбе, а потом кто-то что-то подрисовал и понеслось, завертелось…');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Очень умные дети подозревают, что у аиста с капустой какие-то шуры-муры.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Супружеские узы так тяжелы, что их можно нести только вдвоем, а иногда и втроем.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Немой петух по утрам вибрирует.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Отец Федор 3 года собирает пожертвования на часовню, но пока хватило только на Ауди А8.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Величие Америки в том, что даже с президентом-придурком она процветает. У нас такой фокус не пройдёт.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Только бросив пить Николай Петрович понял, что не так уж хорошо он и танцует.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Минздрав предупреждает: алкоголь - причина всех увлекательных приключений!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Близорукий волк по ночам воет на дыню.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Посмотрел "Пилу" - придумал сестре конкурсы на день рождения.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В деревне отсутствует такое понятие как биотуалет, там есть понятие биополе.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Грустно, когда хочется обнять человека, а перед тобой монитор.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В Люксембурге произошел демографический чпок!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Если в неправильном порядке собрать справки на приватизацию квартиры.  Можно случайно оформить загранпаспорт.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('На высокооплачиваемую работу требуются колдуны, маги, ясновидящие. Подходящие знают куда обращаться.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Не дождусь, когда соцсети проберутся в автомобили. Обогнал такой пробку по обочине и бац: «14 человек считают, что вы мудак».');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Быть умным и хорошо учиться - две разные вещи.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Любите друг друга. Только в малых дозах.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('За разумную плату прискачу в рыцарском костюме, на белом коне к вашему подъезду. Сидящим рядом старушкам сообщу, что я за вами.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Если ваш офис обставлен по фэн-шую — то ОМОН уже не ворвётся с обыском, а гармонично вольётся.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Воспитание детей - процесс серьёзный... Поэтому чаще всего им занимается компьютер.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Даже у стен есть уши успокаивал крокодил гена Чебурашку.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('У моей сестры странная болезнь. Когда она курит при папе, у неё кровь идет из носа.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Костанайский мясокомбинат ищет скотину, а то взял бабки, свалил, теперь найти никто не может.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В детстве я мечтал стать бабушкой! У нас на районе только бабушек не били.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Давно известно, что 20% людей делают 80% работы. Недавно выяснилось, что 80% людей считают, что они входят в эти 20%.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Многие думают, но это не так.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Родители-гопники кормят своих детей семками. Как они говорят – это развивает мелкую моторику рук.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В мире есть еще множество грабель, на которые не ступала нога человека.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Любовь - это когда специально просыпаешься в 3 часа ночи, чтобы проверить в одноклассниках ферму твоей девушки.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Пока Лешины друзья ходили курить за школу, Леша уже курил за район. А потом его пригласили курить за область!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Товарищи курсанты, поставьте дипломаты на пол, а у кого не стоит, зажмите между ног.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В Интернете появились фотографии, как светская львица Ксения Собчак метит свою территорию.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Под новогодний бой курантов Олег с улыбкой на лице всегда загадывает, чтобы ничьи желанья не сбылись.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Перегар трудовика Петрова приходит в школу на 5 минут раньше, чем сам трудовик.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Есть ложь, гнусная ложь, а есть: "Я ничего не нажимала, оно само!"');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Плохо слышащая собака приносит палку на слово "телепорт".');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В субботник обыденная задача нашей роты: собрать все кирпичи и сжечь...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Познакомлюсь с тремя-четырьмя девушками для серьёзных отношений.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Дядя Вася выходя из подъезда говорит одну и ту же фразу: "До дома я бы не дотерпел!"');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Курение вызывает Хьюстон!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В парке Горького избили Сладкого. Причиной послужило крепкое.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Если смешать бочку дерьма и бочку статистики то получится две бочки статистики.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Объявление в садике: "Уважаемые родители, следите за своим поведением! После выходных, за завтраком, все дети чокаются!"');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Света потеряла девственность и боялась идти домой. - Мать убьет - думала она. - Конечно убьет: Потерять 4-ю девственность за неделю, да ещё коньки и варежки!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('По итогам года белгородской кабачковой икре присвоена торговая марка "В переваривании не нуждается".');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Самая распространённая фраза в Третьяковской галерее – «О, это же эта!»');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Кто рано встаёт тот весь день спать хочет.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Замечено, что к куриному гриппу наиболее предрасположена женская половина человечества.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Первое правило бизнеса - поступай с другим так, как он хотел бы поступить с тобой.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Статистика показывает, что на каждого мужчину свыше 85 лет приходится по 7 женщин. Но, увы, это уже слишком поздно.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Мужчины делятся на 3 вида: обнять и плакать, поймать и держать, отойти и поржать.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Во время полового акта геронтофил стал некрофилом.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Лихтенштейн объявил войну Люксембургу. Пока эти два государства не нашли друг друга, но как найдут, такой замес начнётся.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Когда умер Цой, все стали рокерами. Умер Майкл Джексон - попсовиками. Чтоб ты был здоров, Элтон Джон!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Только в России отсутствие состава преступления оценивается судом "по-божески" - от двушечки до пятачка.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Лесник Сергей Иванович уже 5 раз видел снежного человека, но бросать пить не собирается.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Фирма «Изотоп Урана». «Изотоп Урана». Спешите, мы распадаемся!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Если ударить кулаком в стекло, то получится схема московского метрополитена.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Метод «сухой стирки» - это когда из корзины с грязной одеждой достается что-нибудь самое чистое.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Зачем откладывать на завтра то, что можно вообще не делать?');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Арабы проходят «Марио» справа налево.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('На концерте Геннадия Ветрова кто-то крикнул из зала «Плагиат!», но крикнув в ответ «Плагиат - Шмагиат!» Ветров всем доказал, что шутит сам и концерт продолжился.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Молодых девушек в подъезде не было, и бабушкам на лавочке приходилось называть проституткой дворника Митяя.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Китайский фен сломался равно за секунду до падения в ванну.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Сколько Волка не корми, а у Слона яйца больше!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Мой младший брат - первоклассник. Он каждое утро садится на 137-й троллейбус, потом делает пересадку на 564-й автобус, доезжает до 234-го микрорайона и идет в 1128-ю школу, чтобы научиться считать до десяти.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Надпись на водке: "Перед злоупотреблением охладить".');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('По статистике у каждого человека, который обгорел на солнце, есть друг, который хлопнет по спине и спросит: "Как отдохнул?".');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Буратино по жизни был каким-то сучковатым парнем.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Если муравей подымает в 10 раз больше своего веса, то 50 граммов муравьёв можно послать за бутылкой пива.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Сын фермера - единственный мальчик, который одинаково пахнет и до и после физкультуры.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Благополучный брак - это когда есть возможность завести любовника, но нет желания!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Чтобы доказать, что она светская львица, Ксения Собчак догнала и задрала антилопу!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Дима очень любил кошек и собак, но родные не разделяли с ним его кулинарные пристрастия.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Не бери от жизни всё. Зачем тебе столько дерьма?');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('После обеда борюсь со сном на его территории!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Якутский шаман начал скандалить в очереди и два раза получил в бубен.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Мужчина, которому в детстве все покупали на вырост, до сих пор ходит в кроссовках с мигающими лампочками.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Рекламная акция от производителей тестов на беременность: обменяй положительный тест на погремушку!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Нахожусь в прекрасном возрасте: дурь уже выветрилась, до маразма еще далеко!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('«Дорого» — это заставить Мадонну выучить гимн Нефтеюганска.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Разрыв отношений это всегда больно. Не так, конечно, как ножницами в глаз, но все равно не приятно.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Вчера на светофоре в Сергея Зверева врезались стринги.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Дачник Сидоров тырил у соседей кабачки и огурцы, за что и огребал в дыню по самые помидоры.');
