INSERT INTO JOKES (JOKES_TEXT) VALUES ('Если скунса не пугать, а смешить, он запахнет «Живанши».');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Лечение горбатых. Могилотерапия.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Хоронят наркомана. Сзади процессии идут друзья с транспорантом: Вася ты не умер, ты гонишь.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Патриотизм - это играть в компьютерную игру за немцев, чтоб перебить их всех с тыла.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Вот ещё! Буду я всякую блядь оскорблять!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('На самом деле Земля квадратная, но знают об этом только космонавты и те народы, которые живут по углам.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Собаки пограничников живут меньше, но веселее.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Чтобы выполнить план, работница роддома сама каждый год рожает тройню.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Гинеколога очень легко распознать среди других врачей. У него часы застёгнуты на уровне локтя.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('На семейных праздниках девочка, знающая пару стихов и умеющая открывать пиво глазом, вообще не отходит от родительского стола.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Наши в Германии… Табличка на заборе: «Ахтунг! Злюкен собакен. Яйцен клац-клац»');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Есть люди, которые умудряются не только говорить правду, но и даже гадить истиной.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Шла Саша по шоссе и нашла работу.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Хочешь научиться делать сам себе уколы? Основной принцип: представить, что жопа не твоя.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Если вы морально устали - надо отдохнуть аморально!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Китайские гопники щелкают рис.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Одна девочка так сильно боялась прыгать с парашютом, что прыгнула без него.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Самая большая в мире ложь - "Я прочел и согласен с условиями пользовательского соглашения".');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Преподаватель логики не расстроился, когда его друг утонул. Не умел плавать, вот и утонул. Всё логично.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Криминальные новости: на Валентина Юдашкина напали грабители. Как утверждают очевидцы, последний писк моды раздался в районе Бибирево.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Когда растешь на глазах - становишься бельмом.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Радио "Магадан" - нас слушают сидя!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('У Билла Гейтса родилась дочка. Назвали «Новая папка».');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Что думает о вас начальство? "Это устройство может работать быстрее..."');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('А вчера моего друга Сережу посадили на 5 лет, за преступление, которое он не совершал. И он расстроился. А я обрадовался. Ведь я – совершал.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Сардинка увидела подлодку и в страхе подплыла к маме. - Не бойся, дочка, это всего лишь банка с людьми.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Только когда мальчик попросил завернуть в школу 10 бутербродов, мама обратила внимание на его зрачки.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Я бисексуал, мне нравятся и женщины… и некрасивые женщины');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В крови Акинфеева были обнаружены слюни Слуцкого!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Возлюбите врагов своих. И они сойдут с ума, пытаясь понять, что же вы задумали.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('У порностудий самые скучные и будничные корпоративы.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В Сочи плохо отдыхать. На пляже только верхний слой людей загорает.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Мужчина-кобель гонял по двору женщину-кошку.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Собака Дмитрия Анатольевича Медведева не выполняет команды хозяина, пока их не утвердит премьер-министр.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Николай Валуев перепутал военкомат с банкоматом, но деньги всё равно снял.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Якубовича вызвали в школу, потому что его сын в адрес учителя назвал все слово целиком.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Продам котят. 2 недели от роду. Как оказалось, умеют плавать и обладают развитым коллективным разумом.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Настоящий мужчина должен помнить три даты: день рождения жены, день рождения тещи и дату последнего техосмотра.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Бог создавал всех людей разными, но когда дошёл до Китая ему надоело.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('На Руси сладкоежек не удавалось посадить на кол.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Веселее улыбается тот, у кого харя шире.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Научная классификация Буратино - антропоморфный дендромутант...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('У светских тигриц в клетках висят фотографии братьев Запашных.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Шизофреник Дима за обедом успел поругаться с четырьмя пельменями.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Вслед за игрой для детей «Съедобное - несъедобное» вышла игра для умных детей: «Экзистенциальное - неэкзистенциальное».');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Было бы о чем молчать, а уж что сказать - всегда найдется.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Российские староверы до сих пор пишут слово «Блин» через «Ять».');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Робинзон чувствовал, что постепенно девственность возвращаеться к нему.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Мужчина, который 14 лет не платил алименты, не смог разгадать в сканворде слово «совесть».');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('К концу третьего сезона сериала "Секс в большом городе", актрисы начали понимать, что город не такой уж и большой.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Всего каких-то 10 лет и вот уже мой теперешний телефон мощнее моего первого компьютера.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Повестка в военкомат, отправленная почтой России, может продлить отсрочку от армии на 2 года.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Клин клином: в отношении насильников изменена высшая мера наказания.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Уважаемые пассажиры, трамвай следует до "Монолита!" Пьяный мужик: "Ооо! Охренено! Трамвай - следует, дома - налито!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Брак - это мирное сосуществование двух нервных систем…');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Беззубый волк сделал последние минуты зайца незабываемыми.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Настоящая женщина может бесконечно долго смотреть на три вещи..., а купить тушь.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Андрей Бахметьев ведущий программы «Очумелые ручки» единственный трудовик, который пробился в шоу бизнес.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Собрала операционка все браузеры и строго говорит: Предупреждаю! Любого, кто будет чрезмерно жрать память, буду бить по наглой рыжей морде!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Победитель конкурса «Обними себя сам» испытал оргазм прямо на сцене.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Современные дети думают, что Атос, Портос, Арамис и Д''Артаньян - это два грека, латыш и армянин.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Самые смешные шутки рождаются у селекционеров.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Когда ты разговариваешь с Богом - это молитва, когда Бог с тобой - шизофрения.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Фото некрасивых девушек фотошоп сохраняет в формате .pzd');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Девушке-неудачнице, которая гадала на ромашке "любит-не любит" выпало зеро.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Каждый настоящий мужчина должен уметь пугать коней и поджигать избы.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Сборной России нужен такой тренер как Сталин: не выиграли золото, значит поехали его добывать.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('У матросов нет вопросов. За всю историю программы «Что? Где? Когда?» от матросов не пришло ни одного вопроса.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Колумбийские предприниматели пытались открыть палатку с мороженным, но марихуана с Калашниковыми расходились лучше.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Вокзал видел больше искренних поцелуев, чем ЗАГС. А стены больницы слышали больше искренних молитв, чем церковь.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Новости села: пафосный петух не топчет кур, а ходит по ним лунной походкой.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Несчастный случай: бабушка скончалась от бессонницы, читая сказки внуку, страдающему амнезией.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('После того, как ученик матюкнулся на уроке, трудовик выгнал его со словами: «Иди, я научил тебя всему, что знаю».');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('После пяти огнестрельных ранений в руку и трех в ногу лейтенант милиции Иванов выжил! Конечно, выжил, стрелял же он.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Человек с очень большими ступнями не может смотреть телевизор лёжа.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Грабителя, ворвавшегося в сексшоп, обезвредили подручными средствами.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Толстушка-оптимист наполовину полная.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Бабушка, увидевшая свободное место в автобусе, ставит корпус лучше, чем Аршавин.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('У берегов Голландии перевернулся танкер, перевернулся и поплыл на спинке!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Человек с фамилией Следующий никогда не стоит в очереди.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Внук, который провёл всё лето у бабушки в деревне, измеряет давление лучше участкового врача.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Мама, я у тебя принцесса? - Сынок, ты у меня дебил...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Дима так часто курил, что были желтыми даже пальцы ног.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В полицейском участке глухонемая девушка жестами и мимикой пыталась обьяснить офицеру, что её зовут Кончита.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Дядя Саша так часто курил, что были желтыми даже пальцы ног.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Порядочная женщина никогда не простит мужчину, которому она изменила.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Николай Валуев заявил, что он единственный кто может называть Костю Цзю, Костей Хрю.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Соус с грибами называется "грибной соус", соус с чесноком - "чесночный соус". И только соус с хреном - "соус с хреном".');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В моей семье особенно сильна традиция посылать меня в магазин как только я разденусь...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Происшествие. 300 девушек пострадало на концерте Димы Билана. Пострадало-пострадало и успокоилось.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Чеченские блохи, услышав лезгинку, затоптали кошку до смерти.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Призывник три года скрывался от армии, служа на флоте.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Против легкой депрессии можно принять ванную с эфирными маслами. Против тяжелой - с феном.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Он уехал прочь на ночной электричке. Ехать не хотел, но зажало яички…');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Гимн перед матчем Чемпионата России по футболу напоминает молитву: "Только не петардой, только не в меня!"');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Лучший проездной в маршрутке - 1 доллар США.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В городе орудует банда педофилов. Наш юный корреспондент в гуще событий.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Наркоман Вася пошел учиться на режиссера только потому что там есть КРУПНЫЙ ПЛАН.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Во время очередной корпоративной вечеринки в рамках конкурса «Лови крысу» был пойман и зверски избит бухгалтер компании.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Какие только пошлости не напишешь, если забудешь переключить раскладку!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Сербская девушка по фамилии Семеро не дождалась парня из армии.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Человек, любящий конфеты с коньяком, не знает, что с ним произойдёт раньше: сопьётся или слипнется.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Бесплатный сыр получает вторая мышка.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Прогресс в автомобилестроении сейчас направлен на то, чтобы водитель как можно более комфортно мог стоять в пробке.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Чайные листья Липтон содержат антиоксиданты – уникальное вещество, которое, по мнению исследователей, помогает завышать цену на чай в два раза.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('По одежде дачников можно определить, что было в моде 10 лет назад.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('100 млн.$ выделенных на ремонт дорог в Иркутске, решено потратить на 100 тысяч знаков «Плохая дорога».');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Дмитрий Иванович послушал в лесу кукушку и перестал отчислять деньги в пенсионный фонд.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('С водкой все идет хорошо...кроме ног...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Ты у меня такое сокровище, что хочется засунуть в сундук, вывезти на необитаемый остров и закопать.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Смазка Д''Артаньян - три мушкетера!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Влад скрывал от своей девушки полтора сантиметра позора.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('На заводе ботекса произошла утечка. Сейчас рабочие пытаются закатать гигантскую губу обратно в чан.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В последнее время Семен стал относиться к теще значительно лучше: часто приезжал с цветами, красил оградку.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Когда сына сварщика фотографировали со вспышкой, он вскидывал руку и кричал: «Привет, папка!»');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Она была такой сексопыльной, что все ее любовники чихать на нее хотели.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Тебе скучно? Сидишь один одинешенек? Никто не звонит? Набери долгов!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Прочитал: Внимание! Фильм может содержать сцены сексуального характера! Так может или содержит?! Не выносите мозг!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Сегодня в Военкомат пришла группа мазохистов призывного возраста.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Скажите, а Магомет дома? - Нет. - Передайте ему, что гора заходила.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Не место делает человека, а человек место! - сказала уборщица, наряжая елку в общественном туалете.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('У Алеся Мухина в метро украли телефон. Один – ноль в пользу телезрителей.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Сенсация! У генерального директора фабрики «Красный октябрь» все-таки слиплось!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Скоро из-за недобора в армию будут брать котов. Представьте: целая рота котов в сапогах!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Я женщина, я не хочу ничего решать. Я хочу просто выносить всем мозги.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Пуля очень многое меняет в голове, даже если попадает в задницу. Аль Капоне.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Вот уже третьи сутки следователь пытался расколоть орех. Но тот сопротивлялся: "Я буду говорить только в присутствии авокадо!"');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Депутаты так часто ездят по встречке чтобы привыкнуть к левостороннему движению в Лондоне.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Цыганка случайно посмотрела на свою ладонь и потеряла смысл жизни.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Опытный фрезеровщик может показать на пальцах число Пи.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Пиву рад 2 раза: когда зальешь, и когда отольешь.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Вчера в Самаре прошла акция по борьбе с наркотиками среди глухонемых - «Покажи наркотикам нет!»');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Мама Максима Галкина выросла на песнях его жены.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Начался дождь, мы продали зонт и купили водки. Потому что зонт спасает от дождя только одного.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Волшебная палочка из русской сказки: махнешь три раза - и любое желание пропадает...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Чтобы не уволили, пришел на работу на полчаса раньше. Уволили на полчаса раньше.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Когда я был маленький , ко мне прилетела фея и спросила, что ты хочешь? Большой хуй или хорошую память? Я уже и не помню, что я выбрал тогда.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Ну не могу я засунуть свой язык в задницу! Ведь там уже и шило, и диплом, и мечты о светлом будущем...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Говорите ли вы по-английски? - Только со словарем. С людьми пока стесняюсь.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('У калининградских парней все молочные зубы выпадют в один день – день ВДВ.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Российские эмигранты в Америке, провожая масленицу, настолько вошли в кураж, что сожгли Статую Свободы.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Самый талантливый дельфин на носу вертел все приказы дрессировщика.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Людоед съел две сосиски в тесте и три сосиски в тёще.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Когда у моей жены родилась шестерня первое что пришло в голову: пуля.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Казус в цирке: Дрессированная норка отыграла в карты у сторожа тело брата.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Из кустов раздавался девичий крик, плавно переходя в женский...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Толстые стриптизёрши частенько перегибают палку.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Деревенский футболист Иванов, строя баню, поранился, он забивал гвозди и по привычке забил головой.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Уверяя, что она золотая, Пушкин пытался сдать в ломбард осень.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Омский шинный завод выиграл тендер на поставку автошин для "Формулы 1" в количестве 2000 штук, для ограждения трассы.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В Эстонии ограблен Алмазный Фонд. Украдены все три стеклореза.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Девочка с брекетами увидела гигантский магнит и не успела сказать «ОГО».');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Со словами «Юра, только не пей!» директриса отгоняла пьяного трудовика от лужи.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Если я решил ни чего не делать - меня уже не остановить...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Как много дедушек хороших. Кому же достанутся их бабки?');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Родителям, которым не хватает денег на видеокамеру, стараются лучше запомнить выпускной сына.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Якутские грешники мёрзнут даже в аду.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Промоутер в костюме батона был найден в парке мёртвым в окружении обезумевших голубей.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Когда в парке все дети просили купить им сладкую вату и воздушный шарик, Дима требовал бутылочку светлого.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Объявление: "Учащаяся сельхозтехникумa поможет одинокому фермеру поднять хозяйство".');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Вчера сборная Индии по футболу проиграла сборной Бразилии. Жаль... На корову играли.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Свинья увидевшая на дворе мангал начала ловить мышей и лаять на чужих.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Водитель маршрутки - единственный человек, который может закрыть дверь в ванную, не вылезая из ванны.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Вчера, наконец, отдал супружеский долг и решил больше не занимать.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Челябинские сводки происшествий настолько суровы, что в конце них всегда добавляется: не считая женщин и детей.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Комбайнер Иванов увлекся китайской культурой и положил фэн-шуй на посевную.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Как жизнь? Мухам бы понравилось...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Российский народ долго и упорно боролся за права унижаемых, вымирающих, бесправных народностей. Наконец он получил эти права.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Заключенные, получившие условные сроки наказания, делают татуировки пунктирной линией.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Двоечника Петрова весь год весили усы химички! А на выпускном щекотали!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Слишком мощный кондиционер втянул в квартиру бабушку, сидевшую под окном.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Репетитор английского языка утверждает, что его ученица не забеременела, а “the” беременела.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Светочка очень хотела на первое сентября звонить в звоночек, но ее не взяли: то ли, потому что толстенькая, то ли, потому что ей 42.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Дворник ловил снег языком, так он устранял проблему на один процент.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Терпение и труд - всё, я устал.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Полина спит с открытым ртом, потому что считает, что ей так очень идёт.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Это судьба. Инженер Иванов на последние деньги купил лотерейный билетик, а его сбил автобус.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Человек - самое совершенное существо в животном мире только потому, что он сам распределяет места в данной классификации.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Человек, который был всем должен, умер от икоты.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('На мальчишнике у Степана из праздничного торта вылезла «Упаковщица №16».');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Бывает годами ждёшь чуда... И оно приходит – в перьях...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Смех будет ещё заразительнее, если рассмешить туберкулёзника.');
