INSERT INTO JOKES (JOKES_TEXT) VALUES ('Девушки, если у вас нет страшной подруги, задумайтесь... Возможно страшная подруга это Вы.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Настоящий сатирик сидит при любой власти.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Дочь лесника до сих пор лиственница.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Трамвайно-троллейбусное управление примет на работу бубнильщиков для объявления остановок.');
