INSERT INTO JOKES (JOKES_TEXT) VALUES ('Однажды лягушку-путешественницу занесла нелёгкая во Францию...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Жизнь - это перерыв между сном для принятия пищи.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Большинство девушек ищет такого парня, который бы их смешил и в то же время мог бы их защитить. Короче, им нужен клоун-ниндзя.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Оказывается Дантес был геем... Тогда что же получается: Пушкин ещё легко отделался?');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Как барышни с очень длинными ногтями, попу вытирают? А вы думаете зачем гламурным девицам нужны эти маленькие собачки?');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('All inclusive в Турции превращает человека обратно в обезьяну.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('На чемпионате мира по прыжкам в воду спортсмен остановился в метре от воды, потому что вспомнил, что нельзя мочить манту.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Мама, я уже взрослый, мне 25 лет! Если я хочу иксбокс, то я куплю иксбокс. Дай денег!');
