INSERT INTO JOKES (JOKES_TEXT) VALUES ('Я не страдаю безумием, - я им наслаждаюсь!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Дима устроился в зоопарк, но администрация долго не могла понять сотрудник он или питомец!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Родственники - это группа людей, собирающаяся время от времени для того, чтобы пересчитаться и хорошо выпить и закусить по поводу изменения их количества.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Челябинские мужики, снимают носки гаечным ключом.');
