INSERT INTO JOKES (JOKES_TEXT) VALUES ('Анна Семенович, когда пугается, прячет голову в грудь.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('А нельзя кошачий корм как-то поскромнее называть? Меня, например, угнетает тот момент, что кошка сейчас ест рагу из кролика, а я пельмени из сои.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В день крещения Руси священники купаются в фонтанах, спрашивают "в каком храме служил?!" и разбивают кадила об голову.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Согласно рассчетам ученых, что через 10 лет воду из Москвы-реки будут продавать по 40 долларов за баррель.');
