INSERT INTO JOKES (JOKES_TEXT) VALUES ('Безопасный секс тот, который не приводит к женитьбе.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('- Я смотрю у вас руки в мазолях? Давно один живете?');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Наши учёные вывели новый вид зрячих кротов, но кроты-староверы продолжают выкалывать себе глаза.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Мэр города Сочи считает,что государству следует выделять больше денег на Олимпиаду - Майбах уже устарел.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Что же было изображено на флаге Канады, если пришлось это закрывать кленовым листом?');
