INSERT INTO JOKES (JOKES_TEXT) VALUES ('Весело позвякивая карабинами, вниз быстро пронеслась связка альпинистов.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Доярка, набирая воду в чайник, по привычке мнёт кран.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Я горжусь двумя людьми: Гагариным и Ньютоном. Один попытался сьебать с этой планеты, а второй доказал, что у первого нихуя не выйдет!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Скоро во всех городах России: зашёл в магазин, погрелся, вышел.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Пьяный Дима так классно поёт в душе, что тараканы под ванной начинают пританцовывать.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Переименуйте, пожалуйста, экзамены в Государственную Аттестацию Выпускников Нового Образца. А то все ЕГЭ, ЕГЭ.');
