INSERT INTO JOKES (JOKES_TEXT) VALUES ('Челябинские женщины настолько суровы, что умеют молчать.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Хочу увидеть новогоднее поздравление Путина в переводе Гоблина...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Таки не смог Сергей Зверев проложить путь к сердцу Бориса Моисеева. Кишка тонка.');
