INSERT INTO JOKES (JOKES_TEXT) VALUES ('Плотник, делающий дверные косяки, и по жизни не очень прав.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Никита Михалков доволен. У него в машине икона с его изображением.');
