INSERT INTO JOKES (JOKES_TEXT) VALUES ('У страшненькой Лизы секс бывает только на день города.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Эстонские новости сразу выходят на канале "Ностальгия".');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В полете слепой птицы больше смысла чем в вождении женщины...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Кактус - глубоко разочарованный в жизни огурец.');
