INSERT INTO JOKES (JOKES_TEXT) VALUES ('Время - лучший учитель, но, к сожалению, оно убивает своих учеников.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В экзотических судах обвиняемый имеет право на авокадо.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Лучше плохой день на рыбалке, чем хороший на работе!');
