INSERT INTO JOKES (JOKES_TEXT) VALUES ('Главное, при знакомстве с девушкой в магазине не говорить ничего подобного: «Ого, сколько у вас туалетной бумаги. Я - Миша, и тоже какаю!»');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Круглая отличница Катя вкатывается в класс.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В московскую ветеринарную клинику им. доктора Айболита доставлен хомяк с грыжей обеих щек.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Идете в казино — одевайте самые красивые трусы. Возможно, именно в них одних вы будете возвращаться.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Январь февраль феврарт феврель феврай феврюнь…');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Cпасибо в кровать не положишь.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Заметив, что невеста в положении, работница ЗАГСа спросила согласия только у жениха.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Я сегодня получил черный пояс. Пальто целиком украсть не успел.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Новый сорт водки "Властелин Колец"! Почувствуй себя Гоблином!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Вчера московские милиционеры разогнали гей-парад. При этом обе стороны обзывали друг друга одними и теми же словами.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Только русские люди,чтобы не платить штраф за ложный вызов пожарным жгут мебель в прихожей.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Имодиум - быстро избавит вас от Даниссимо.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Щастье – это тада, када ты делаиш ашипки, а тибе их пращают!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Дима понял, что родители его не очень любят, когда на кассету с его первыми шагами они записали «Аватар».');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('После развода одни становятся одинокими, другие - свободными.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Хорошее море – Мёртвое море.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В детстве, чтобы Змей Горыныч был как все, мама заплетала его в косичку.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Сидит девица в темнице, за убийство проводницы.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Билл Гейтс после секса переходит в спящий режим.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Пятиклассник Вахтанг требует затонировать окна в классе, "а то как лохи сидим".');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Я не могу спокойно смотреть на страдания окружающих. Пойду возьму поп-корн.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Маша Распутина одним поцелуем устраняет засор в раковине.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Либо делай, либо не делай. Но не пытайся пытаться!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Значительно повысился уровень культуры в Сызрани: целых три дня провисела не исправленной реклама "Ешь. Пей. Жуй."');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Девушки с маленькой грудью, не парьтесь... зато вы точно знаете, что вас парень любит реально за глаза.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Собака Никиты Михалкова не повиливает хвостом, а повелевает.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Если муж и жена всегда взаимовежливы, то и семейные ссоры сводятся к спокойному, неторопливому обмену оскорблениями.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Потому, что я не механик! Да, я не знаю, каким концом отвеpтки забивают гвозди и что?');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Ока признана самой безопасной машиной для секса. Как не крутись, все равно ничего не получится...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Среднестатистический пользователь Android проводит 18 минут в неделю объясняя, почему он не купил iPhone.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Дэвид Коперфильд может не только проходить сквозь стены, но и проносить через них 40 ящиков водки – утверждал сторож магазина №5.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Папа пришел домой с шампанским и червями, и мама клюнула на это.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Девки ГОЛО-СИСТЫЕ свели его с ума.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Стриптизёрша Люся чуть не сорвалась, держась за поручень в троллейбусе.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('У фрезеровщика с тремя пальцами есть 2 очень смешных случая из жизни.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('На программе «Поле чудес» пенсионерка из Липецка, понимая, что ей нечего подарить, не растерялась и вырвала у себя 2 золотые коронки.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Режиссер фильма ужасов, несомненно, был гением. Уже через пять минут просмотра, в зале нечем было дышать.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Возле роддома каждый второй папа ищет третьего.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Не желающий рано вставать Игнат валенком перевёл петуха на попозже.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Замечено: далеко не глупые люди на мгновение впадают в замешательство, если предложение заканчивается не так, как они борщ.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В чем сходство между женщиной и сигаретой? Если женщина балерина - то они обе тонкие и большую часть времени проводят в пачке.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Фирма «Контекс» предлагает свои услуги по оформлению банкетных залов и детских праздников.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Чемпионат России по подледному лову закончился полным провалом.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В летнем лагере ребята всю ночь играли в бутылочку без девочек. И правильно: девочки-то могли и воспиталке настучать, а пацаны - люди надёжные!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Страшные тёлки очень коварны. Они только и ждут, когда вы напьётесь, чтобы с вами проснуться.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Самые любимые фильмы и мультики моего детства оказывается были минимум 16+! Какое страшное у меня было детство...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В Дагестане с позором в пропасть была сброшена нетонированная Лада Приора.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В наших фильмах, чтобы получить немного денег студенты сдают кровь. В американских - сперму.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Лысый президент может запретить расчёски.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Ваша киска сдохла от "Вискас"! Дохлый кот - меньше хлопот!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Компьютер – это не для женщин. Сказала хозяйка которая пыталась выбить с него пыль.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Если на телефоне набрать номер "20", то полицаи приедут задним ходом!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Капля никотина убивает лошадь и она весь день ходит убитая.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Если к сердцу путь закрыт нужно в почки постучать.');
