INSERT INTO JOKES (JOKES_TEXT) VALUES ('Несмотря на проливной дождь, синоптик Ласточкин принципиально загорал!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Охотники 7 часов шли по следу косолапого лесника, думая, что это медведь.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Очень бородатый дворник метет улицы даже когда идет домой.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Юрий Куклачев был замечен в тусовке с новой киской.');
