INSERT INTO JOKES (JOKES_TEXT) VALUES ('У каждого человека есть фотография, где он маленький в колготках рядом с елкой. Причем, вне зависимости от пола.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Водитель Феррари обогнал Хаммер справа, но Хаммер тут же обогнал его сверху.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('После двух бутылок водки Дима думает,что в совершенстве владеет Кунг-Фу.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Только в России есть черно-белый телевизор «Радуга», наручники «Нежность», бензопила «Дружба», слезоточивый газ «Черемуха», межконтинентальные баллистические ракеты «Мир».');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Карлсон, который живет на крыше, подрался с бомжом, который хотел жить там же.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('После съеденной порции мантов Дима понял, что "отрыг" значительно сквернее чем "пердок".');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Принято решение запретить въезд ВАЗов в центр Москвы, чтобы не расстраивать чиновников видом спасенного ими автопрома.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Безумству храбрых - венки со скидкой.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Сергея Дроботенко не узнали на улице и избили. Ему ещё повезло, что не узнали.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Египетские акулы видели многое, но русских со словами: Вау, дельфины! - боятся до сих пор.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Закончилась неделя высокой моды в Сыктывкаре. Как обычно дракой.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Ничто так не помогает сделать выбор, как пытки...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Попавший в толпу ВДВшников в день ВДВ Дункан Маклауд сильно жалел, что смерть так и не наступит.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Каждое государство имеет свою мафию, а в России мафия имеет своё государство.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Бежит собака по пустыне и думает: ну все, если сейчас кустик не найду, обосусь.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Они пили долго и счастливо, и подохли в один день.');
