INSERT INTO JOKES (JOKES_TEXT) VALUES ('Вчера на Кутузовском столкнулись «Бентли» и старенькая «Копейка». Пострадавших нет. Есть униженные.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Когда Ким-ир-сен учился в Советском союзе, его звали И-го-рек.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В России замалчивают комплименты женщинам.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Во Франции лягушки не квакают.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Это ж как надо ненавидеть своего ребёнка, чтобы при фамилии Штопаный назвать мальчика Антон?');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Объявление из Челябинска: Куплю стекло, решётку для вытяжки, валидол и ситральный порошок.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Роман Абрамович купил ярославский «Шинник» и в этот же день выпустил ребят на волю.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Группа неприглашенных гостей, без объявления войны, вероломно напала на спиртное.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Реаниматологи дают клятву лично Гиппократу.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('От любви до ненависти один шаг. Один шаг грязными ботинками по чистому паласу.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Это всё женщины - загадочно вздохнут, а нам потом думай, что им не нравится и объясняй почему мы были в этом неправы...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Что такое шампанское? Жидкость для снятия женщины.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('На вопрос анкеты "Семейное положение", гордо написал - "Сверху".');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Шоколад вдвойне вкусней, если ночью и нельзя!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Суеверный верблюд плюет через левое плечо.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Мужчине нужна жена, потому что не всё на свете можно свалить на правительство.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Пользование банкоматом - это как секс. Кому-то хватает пяти минут, а кому-то и получаса мало.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Вчера в городском морге произошел взрыв. Жертв нет.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Как надоело слышать: «Ты сильная, ты справишься»… Я слабая! Я на шею хочу!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Никогда б не подумала…если б не мозги!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Наших бьют - еле убежал.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Идут два репера: один в кепке, второй тоже пизды получит.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В московском зоопарке павианы убили сородича за сотрудничество с администрацией.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Когда я открою свою фирму, я обязательно назову её ООО "ООО". А потом буду смотреть, как секретарши отвечают на телефонные звонки.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Губки бантиком, бровки домиком..... опять смешала ром с джин-тоником...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Мы поняли, что наш сын наркоман, когда из дома стали пропадать накротики.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Новая бритва для ног брила так гладко, что с Марины сваливались колготки.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Шестилапый медведь просыпается чуть-чуть позже остальных.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Счастье - это когда в вагон садятся дембеля и цыгане, а тебе выходить.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Прежде чем назвать женщину зайкой, подумай, хватит ли у тебя капусты и не подведет ли морковка.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Если виноватых нет, значит они уже у власти.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('От эстонца на прогулке убежала любимая улитка.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Дорогой, тут мои подруги в ночной клуб собираются, можно я с ними уже ушла?');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Парень, провожая девушку до квартиры, понял, чем закончится свидание, по надписям в подъезде.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('90% девушек на вопрос зачем нужны умные и красивые девушки ответили ГЫ-ГЫ-ГЫ');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Еще 10 лет таких цен и зарплат, и вместо переписи населения будет перекличка.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Если бы не мы, дураки, кто бы вас, умных, заметил?');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Дагестанские блохи услышав лезгинку затоптали кошку насмерть.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('У него было два незаконченных средних и… один старший сын.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Самые хорошие домашние животные - комары: кормить не надо, хоронить тоже.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Чужие деньги считать неприлично, а свои - грустно.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Стриптизёр Чиполлино доводит зал до слёз!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('2012 год объявлен годом несмешных шуток о конце света.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Статуэтка премии Оскар, будучи вручена Никите Михалкову, заплакала.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Добро должно быть с кулаками. Елена Малышева на улице набросилась на прохожую и силой заставила выпить таблетку от кашля');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Кутузов некогда сказал «Чтобы спасти Россию, надо сжечь Москву!» Как он был прав!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Раком не рождаются, раком - становятся.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Ученые говорят, что с повышением градуса, тупеют не только углы, но и Дима из соседнего подъезда.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Сколько водки не бери, все равно два раза бегать!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Вчера Олег Газманов закончил прыгать над новым альбомом.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В США афроамериканцев-библиотекарей называют книггеры.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Одна очень жадная девочка рассказывала всем, что она гермафродит, чтоб получать подарки ещё и на 23 февраля.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Любитель виски склеротик Сидоров понимал, что что-то не так, но всё равно покупал "Вискас"');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Согласно тестам «Космо», Семён - гораздо более симпатичная, сексуальная и уверенная в себе женщина, чем его жена.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Сочинские травматологи делают рентгенограмму с обезьянкой.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Переубедить Вас мне не удастся, поэтому сразу перейду к оскорблениям.');
