INSERT INTO JOKES (JOKES_TEXT) VALUES ('В одну из смен на «АвтоВАЗе» кончились детали. Но рабочие не растерялись и доделали машины до конца.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Однажды Мальчик-с-пальчик ковырялся в носу и застрял...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Вчера стоял, а ты пришла сегодня.');
