INSERT INTO JOKES (JOKES_TEXT) VALUES ('Дагестанские шахматисты. Согласитесь, неудачное название для организованной преступной группировки.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Водитель маршрутки с очень плохой памятью, по утрам выпускает пассажиров из гаража.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('И как говорит начальник «Сочи Олимп-строй»: «Столько денег вложили, давайте что-то делать уже!»');
