INSERT INTO JOKES (JOKES_TEXT) VALUES ('Скандал в секс-шопе – покупателей обвешивают.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Курице пришла повестка в суп.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Маршрутка - единственное место в России, где финансовый поток может пройти трех посредников и никто не возьмет откат.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Из-за преступной халатности работников Эрмитажа картина Казимира Малевича "Черный квадрат" два месяца провисела вверх ногами.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Открывая бутылку Бордо 1812 года пальцем Семен не знал, что застрянет в прошлом.');
