INSERT INTO JOKES (JOKES_TEXT) VALUES ('52-ая школа города Тольятти отозвала назад весь выпуск 2009 года.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Мама Михаэля Шумахера в детстве вместо слюнявчика вешала ему брызговички.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Автослесарь сидоров попал под машину и починил ее.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Он говорит, что это было в экстазе, а я точно помню, что в сарае...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Перекати-поле – это скелеты погибших колобков.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Никогда не кричите в аэропорту: "Алла, я в бар!"');
