INSERT INTO JOKES (JOKES_TEXT) VALUES ('Два бомжа захватили четырехкомнатную квартиру в центре Москвы и больше ничего не требуют.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Kaк я oтнoшуcь к сексу? Да я ему жизнью обязан!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Почтовые голуби тормозят развитие Интернета в Зимбабве.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Налейте мне водки, хочу смыть с себя налёт цивилизованности!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('На переполненном корабле на фразу человек за бортом отвечали «Жаль его…».');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Кто рано встает, тот дворник, а кто поздно встает, вообще...мэр.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Маргарита Федоровна из села Стародевино, Оченьхочетского района Немогуужевской области вывела новый сорт огурцов. Вооооот такенные!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Будильник ненавидят в двух случаях - когда он звенит, и когда он не прозвенел.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Кругом враги, один я добрый - сижу в блиндаже, стреляю...');
