INSERT INTO JOKES (JOKES_TEXT) VALUES ('Многие школьники, которым пришлось прочитать все 4 тома "Война и мир", жалеют, что на дуэли убили Пушкина, а не Толстого.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('По утрам на Казантипе так тихо, что слышно, как сужаются зрачки.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Скажи простуде, что у тебя есть планы поважнее: ангина, воспаление легких, менингит.');
