INSERT INTO JOKES (JOKES_TEXT) VALUES ('Автограф Билла Гейтса победил на конкурсе самых коротких резюме.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Визитки Никите Михалкову делает Иконописец Владимирского собора.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Женщина-программист — как морская свинка: и не морская, и не свинья.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Не убегай от снайпера - умрешь уставшим!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Возле здания мэрии голубей не кормят, а только обещают покормить.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Дима был простым матросом, поэтому не знал, что, при погружении подводной лодки, дыхание не задерживают.');
