INSERT INTO JOKES (JOKES_TEXT) VALUES ('Не могу стоять, когда другие работают. Пойду полежу.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Русский язык очень краткий и лаконичный. Например, надпись "Здесь были туристы из России" состоит всего из трёх букв...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Мальчик с водяным пистолетом целый месяц держал в страхе карбидовый завод.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Принимаем дубы... Выпускаем липу... Думал ректор МГУ подписывая дипломы.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Дятел с тупым клювом вылизал себе дупло.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Во время обыска на квартире у Анатолия Вассермана оперативники обнаружили смысл жизни.');
