INSERT INTO JOKES (JOKES_TEXT) VALUES ('В виду отсутствия альтернативы блондинку провожают по одёжке.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Надо выпустить пельмени под брендом "Пичалька". И слоган - "Нечего жрать? Пичалька!"');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В издательстве «Детская литература» вышло в свет учебное пособие для самых маленьких - «С кем такое хорошо и с кем такое плохо...».');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Молодая семья, из трёх мужчин, снимет девушку лёгкого поведения, дабы проверить себя на крепость!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('У чеченских мальчиков в 7 лет начинает выпадать молочная борода.');
