INSERT INTO JOKES (JOKES_TEXT) VALUES ('Мальчик, который прошёл «Марио», по привычке берёт сдачу головой.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Почему туалет вечно занят? А зачем вы туда звоните?');
