INSERT INTO JOKES (JOKES_TEXT) VALUES ('Вань, мы халтурим, а ты, я смотрю, в полную силу пьешь?');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Продолжайте, продолжайте, я всегда зеваю, когда мне очень интересно...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('50 граммов коньяка повышают здоровье. Вот так сантехник Петров уже 15 лет приходит домой в 10 раз здоровее обычного!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Воронежскому ликероводочному заводу срочно требуется грузчик без рта.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('После того, как подслеповатая бабуля включила на кухне свет, наглый таракан не убежал, а мяукнул и потёрся о ногу пенсионерки.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Аванс! Как много в этом звуке.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Если женщина просит, надо... искренне пообещать.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Мало кто задумывается о том, что многие математики задумываются о том, что они выбрасывают пакет с мусором по параболе.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Сотрудники полиции поняли, что преследуют невиновного, когда тот начал уходить от них по воде.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Египетские акулы видели всякое, но русских со словами «тили-тили, трали-вали» они боятся.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Моя жена с каждым днем становится все краше, но времени на это по утрам уходит все больше.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В деревне из-за подсолнуха подрались воробей и гопник.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('По статистике люди, которые верят в апокалипсис, консервируют меньше!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Алкоголь дает обманчивое ощущение, что "все хорошо", а трезвость дает обманчивое ощущение, что "все плохо".');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Если автомобиль Ока разогнать до 120 км/ч, он переместится в прошлое.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('69 людей из тысячи находят что-то пошлое в каждом предложении.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Не все советы хороши - подумал президент. Какая зарплата, такие и советы - подумал советник.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Выпей отравы тварь! Ой, блять, перепутал: Выпей отвар из трав!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Я как демократ, даю вам право выбора: идти на хуй или в пизду!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('ТОЙОТА - управляй мечтой. ВАЗ - не ссы, доедем!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Единственная женщина средних лет, которая не любит Стаса Михайлова это теща Стаса Михайлова.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Второклассник Игорек так сильно дёрнул за косичку Машу, что у нее выпал молочный зуб.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Как называется человек, который не дарит подарков своей любовнице? Ответ: Дармоёб.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Случайными бывают только браки, - говорила мне бабушка. - А в любовники нужно брать человека надежного.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Любишь кататься? Катаца тоже любит тебя. Секта имени Сузуки Катаца ждет вас!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('На директора Автоваза хотели завести уголовное дело, но оно не завелось...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Шампанское по-домашнему: водка под шипение жены.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Значoк на 150-килограмовом мужике: Спроси меня как. Похудей.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Председатель колхоза «Светлый путь» купил себе желтое «Бугатти» потому что он реально не успевает за посевной.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Любой опытный лесник знает не менее десяти рифм к слову "ау!".');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Доказано, что 90 % резиновых женщин надуто перегаром.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Приёмные дети Анжелины Джоли подольше притворяются грудными.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В Германии можно сдать пластиковую тару и получить 10 рублей. Проблема в том, что там делать потом с рублями.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Мама, не хочу я в эту Америку! - Заткнись и греби дальше!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Как ни жаль было Малышу Карлсона, но папе очень нужен был новый лодочный мотор...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Николай Валуев всегда открывает двери в нужную ему сторону.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Объявление: меняю книгу о контрацепции на детскую коляску.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Ощущение надвигающегося конца у Маши появлялось обычно уже после третьего бокала шампанского.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Николай Басков уверен, что цветы растут в зрительном зале.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Поздравляю с днём рождения! Желаю тебе счастья, любви, здоровья, красоты, денег побольше, квартиры, интересной работы, верных друзей, ума, а всё остальное у тебя есть.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Достяжение рифформы апрозаванья: на экзаменах разрешено пользоваться кошельком.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Тупанул, подумал Сережа, летя с крыши девятиэтажного здания вслед за своими друзьями.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Жизнь - это компромисс между желанием есть и желанием спать.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('На вопрос «Пользуетесь ли вы Интернетом?» утвердительно ответили 100% россиян. Таков результат опроса, проведенного на интернет-сайте ВЦИОМ.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Сегодня ходил к соседке просить денег в долг. Не дала. И денег тоже.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В центре Москвы установлен памятник приезжему лоху. Доехать до него можно за 2 000 евро.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Опытный игрок в дартс может передать за проезд с любого конца автобуса!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Несильно мил не будешь.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В магаданских школах в кабинете литературы висит портрет Шуфутинского.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Какой русский не любит во время быстрой езды, сидя за рулем, разговаривать по мобильнику!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Объявление: На телеканал НТВ Требуется бугор, смотрящий и торпеда.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Я зарегистрировался посмотреть, не зарегистрировалась ли она, чтоб посмотреть, не зарегистрировался ли я.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Как тебе Гавайи? Никак. Я думал, все будут ходить в юбках из листьев и со скорлупой кокоса на голове. А я там один был такой.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Стринги со стразами: больно, но модно.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Купила мелки от тараканов, в голове тихо, сидят рисуют...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Перед тем как идти в гости, расправьте кровать. Когда вернетесь домой, то поймете, насколько мудро вы поступили.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В Молдавии за второго ребенка правительство выделяет мешок цемента. Но потратить его можно только на образование.');
