INSERT INTO JOKES (JOKES_TEXT) VALUES ('Тем временем миру нужна сила, способная объединить в себе все пороки общества, не дожидаясь пятницы.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Конкурс «Мисс Дагестан» прошел на ура. «Ура!» сказали зрители, когда конкурс закончился.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('«Волгарь-Газпром» выиграл в «камень-ножницы-бумага» кубок «Цу-е-фа».');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Ничего не откладывай на завтра, лучше откладывай на послезавтра, будешь иметь два свободных дня.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('История Алсу, как певицы, началась 400 миллионов лет назад, когда под действием тектонических сдвигов, в недрах земли зародилась нефть.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Главная проблема цитат в Интернете в том, что люди сразу верят в их подлинность (В.И. Ленин).');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Президент компании «Липтон» наложил запрет на использование чайных пакетиков по два раза.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Водители двух автоэвакуаторов подрались на дороге из-за лексуса.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Суеверные пожарные, прежде чем войти в горящее здание, запускают туда кошку.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Зачем о Вас, давайте о приятном!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Только через мой труп! - кричат нам муравьи. Но мы этого не слышим...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Катя и вискас ела, и обои в коридоре драла, но муж всё равно называл её коровой, а не киской.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Извините, а вы случайно не знаете, эти ребята до добра не доведут?');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Дед посмотрел "Властелина колец" и сказал, что фильм ничего, только немцы там страшные.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Свою жизнь могу распределить на два периода: «Вокруг происходит какой-то пиздец» и «Сплю».');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Акция при входе в гей-клуб: каждому десятому - каждый одиннадцатый!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В ночь перевода часов на час вперед секс может длиться час и три минуты.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Мама трансвестита Олега не знала, как реагировать на ситуацию, вроде и гвоздь в доме забьет, и помадой поделится…');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Кристина настолько любила всё делать по-своему, что училась целоваться на огурцах вместо помидоров. И, как оказалось позже,... не прогадала...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Для женщины мужчина - как пирожок: кому-то нравится с капустой, а кому-то с яйцами.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Мочевой пузырь - как сердце. Ему не прикажешь.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Для того, чтобы Степа ел суп быстрее, мама на дно тарелки клала противоядие.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Просто так просить денег - неправильно. Побираться надо с достоинством.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Простым камнем можно подбить женщине глаз. Драгоценным - сердце. Но старые умные люди говорят, что лучше все-таки... глаз.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Наш обучающий курс "как избавиться от интернет-зависимости" - теперь и в онлайн варианте.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Футбольный тренер занимается со своей женой сексом по системе 4-3-3.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Одна белка случайно попробовала пиво и поняла зачем она всю жизнь собирала орешки.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Она отбросила коньки. И коньки отбросил мальчик, который катался сзади.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Очень воспитанный мальчик, упав в канализацию, закрыл за собой люк.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Человек, выросший на фильмах Джеки Чана, после секса вспоминает все неудачные моменты.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Глаза бояться, а руки пристёгнуты к батарее.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Без труда не вытянешь, когда с трудом засовываешь.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Если хочешь жениться на умной, красивой и богатой - женись три раза.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Оказывается, певица Максим донашивает имя за старшим братом.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Наркоман Николай был уволен с завода за то, что он слишком много вкалывал на работе.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Ни дать, не взять - ангина во время месячных.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Как музыку не сортируй, а папку «разное» создать придется.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Над городским кладбищем разбился двухместный самолет. Спасатели уже извлекли 614 тел пострадавших...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Новый костюм Леди ГаГа на бразильском карнавале произвел фурор, затем произвел два выстрела в торт и скрылся в толпе.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Что сказал студент, который не сдал сессию? Служу РОССИИ!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Бухгалтер шинного завода не там поставил запятую и вывел слесаря Гусева в 10-ку Forbes.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Дятел задумался и выпал с обратной стороны дерева.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Когда рядом нет Аллы Борисовны, Максиму Галкину для собственной безопасности приходится пародировать Николая Валуева.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Роман Абрамович, делая ремонт в квартире, нашел заначку жены, которая копила на волейбольный клуб «Уралочка».');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В летнем лагере все мальчики ушли спать раньше девчонок и те не знали как потушить костер.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Счастье - это когда люди, которые вам не подходят, к вам не подходят.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Выпущен новый сорт водки "Властелин Колец"! Двойной крепости, 80 градусов. Почувствуй себя Гоблином!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Говорят, что если чайный пакетик заварить 8 раз, то чаинки сами всплывут, чтобы посмотреть на твою скупердяйскую рожу.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Взрывная волна от челябинского метеорита докатилась до Сочи. Разружено 350 км дорог и 13 стадионов. Из бюджета выделено еще 200 трлн рублей.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('У меня с совестью договоренность: она меня не грызёт - я её не имею.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Двести рыбаков было снято со льдины снайперами МЧС России.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Не понимаю людей, которые бросают курить. НЕЛЬЗЯ ВОТ ТАК СДАВАТЬСЯ.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Будь хитрее, если родители нашли в твоей комнате наркотики, скажи, что это не твоя комната.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Мама студентки ПТУ № 10 начинает подозревать, что в Урюпинске нет никакого ночного консервного завода.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Терпение и труд... Пусть на хер идут!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Днем любят за достоинства, ночью за пороки.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Самая большая студенческая ложь: "Список использованной литературы".');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В Иваново после 5 лет мытарства застрелился гей.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Чтобы понравиться девушке, надо быть умным, красивым, богатым... или котом.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Очереди в поликлинике отсеивают тех, кто может и сам дома полечиться.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Когда японцы увидели, как русские туристы после заваривания чая кладут чайный пакетик в рот и высасывают остатки, они поняли, что за Курилы Россия будет бороться до последнего.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Скайп придумали евреи - вроде бы как у тебя гости, а кормить-поить не надо.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Поезд «Санкт-Петербург — Ленинград» отходит с третьего пространственно-временного континуума.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В Одессе на сигаретных пачках написано: «Мама узнает - убьет»!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Раньше у писателей были РУКОписи. А сейчас - КЛАВАписи.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Любой мужчина знает: полная сковорода - кормит, а пустая - воспитывает.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Групповуха появилась тогда, когда Купидон начал использовать осколочные гранаты.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Только повзрослев Дима узнал, что на самом деле Фанта на вкус не соленая.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Кандидат в президенты Владимир Путин обещает исправить ошибки правительства, которые не исправил премьер-министр Владимир Путин, которому все беды достались в наследство от экс-президента Владимира Путина.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В споре полезно перейти на сторону оппонента - и уже оттуда нанести удар!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('По мнению крокодилов, человек на 100% состоит из еды.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Хороший порно сайт - рукам покоя не дает.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Как пить? Советское шампанское: Купил - Выпила - Плачет - Смеется - Спит - Везу домой. Пиво: Выпил - Сходил - Выпил - Сходил - Выпил - Выпил - Уснул ... - Сходил...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Лучший способ не опаздывать - не приходить вообще.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Дорогой будильник, не звони мне, пожалуйста, больше по утрам! Между нами всё кончено!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Мужское достоинство - это не то, что в штанах, а то, что в гараже. То, что в штанах - это женское счастье.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Чернобыльская атомная электростанция выполнила план пятилетки за две миллисекунды.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Семинар, посвященный проблемам путешествия во времени, будет проведен две недели назад.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Иногда моего мужа от меня трсяет. Все-таки я потрясающая женщина!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Специалист, отвечающий за безопасность АЭС, сказал «пиздец» из-за вытекшей в кармане ручки. Но 15 человек все равно поседели.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Учительница литературы потеряла среди книжек обед, телефон и молодость.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Вампир, укусивший Зюганова, вспомнил вкус советского пломбира.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('О, этот дивный момент, когда ты знакомишься с человеком, и еще не знаешь какой он мудак.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Рукописи не горят. А некоторые ещё и не тонут.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Мужик впал в ступор, застав дома любовника жены с незнакомой женщиной.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Все обломалось в доме Смешанских.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('И смех и грех: сатанист обжег язык святой водой.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Московская милиция арестовала группу зоофилов. При задержании использовались специально обученные собаки.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Из-за талии Наталии в Анталии возникла мужская баталия.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Нахожусь в прострации. До сих пор не могу простраца.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Случай - псевдоним Бога, когда он не желает подписываться собственным именем.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('До 5 лет он думал, что его зовут : Заткнись!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Мальчик доставал соседей игрой на скрипке по 5 часов 7 дней в неделю, а врач извлекал скрипку из попы мальчика всего 5 минут. Где справедливость, спрашивают соседи.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Он говорит, что любит мясо и ест его. Он говорит, что любит цветы и рвёт их. Он говорит, что любит меня, и мне страшно...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Парень пишет девушке sms: «Мне было очень хорошо с тобой!» Она ему в ответ: «Не тебе одному!».');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Что посеешь - то хуй найдешь.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Трудно говорить с набитым ртом. Особенно если бьют регулярно.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Предельная степень скупости: связывать разорвавшиеся резинки для денег.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Мало кто знает, что Джордж Буш младший попал в политику через постель Джорджа Буша старшего.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('«Любишь медок, люби и холодок!», - сказал Саб-Зиро и заморозил пчеловода.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Подковать блоху - абсолютно не бесполезная работа! Их потом магнитом ловить можно.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Когда мужик женится-думает, что лучше её нет.Когда разводится-думает, что хуже её нет...И в том и другом случае он жестоко ошибается !');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Гурбангулы Бердымухаммедов у Танинбергена Бердонгарова ничего не украл.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Профессор уснул на лекции и своим храпом разбудил студентов.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Если на тренажере крутить педали в обратную сторону, то можно потолстеть.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Я уже целые сутки ничего не спал.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Мазай сегодня не в духе - перешёптывались зайцы глядя на Герасима.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Друзья приходят и уходят. И тока, враги, сука, накапливаются.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Мальчик Коля не доставал до кнопки девятого этажа и писал на пятом.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Продавщица шаурмы неплохо пеленает детей.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('На человека, пившего воду из-под крана, упал крановщик.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В 2012 году при аресте граждане будут иметь право на адвоката, телефонный звонок и обновление статуса в фейсбуке.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('У Вячеслава была самая красивая девушка в округе. Поэтому в армию его провожали всем двором.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Шла Саша по шоссе, а сушку сосала уже в реанимации.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Женщины выбирают мужчин как пирожки: кому-то с капустой, кому-то с яйцами...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Вчера с мясокомбината сбежало 2 коровы. Бухгалтершу Валентину уже нашли.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('У китайцев кризис перепроизводства - они уже подделывают подделки.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Неприятность у монгольских авиалиний - лошади, разгоняющие самолет, бастуют.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Великая китайская спина заканчивается великой китайской жопой.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Кошка, которая гуляет сама по себе, была съедена бомжом с таким же хобби.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Если после встречи с вами у девушки очень злые глаза, значит вы поступили правильно, но не благородно.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Мышечная память - это когда страница еще не загрузилась, а ты уже поставил мышку на то место, куда надо кликнуть.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Если девушка липнет, её нужно отодрать.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('От тебя вкусно пахнет, что за духи? Каталог Avon ароматизированная страница № 55.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Утром в туалете Михаил Боярский забыл опустить за собой потёртое седло.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('После разгона гей-парада у омоновцев пропало 17 дубинок.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Запись в школьном дневнике. Спервоначалу вёл себя эпатажно, фраппировал и манкировал напропалую. А следом вдруг сделался этакий бука, замкнулся в себе. Амикошонство. Фи.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Вчера в книжном магазине была украдена книга "Как жить по-христиански".');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Ничего страшного если над тобой смеются. Гораздо хуже, когда над тобой плачут.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Никак не могу понять: что может заставить молодую, цветущую женщину поступить в консерваторию по классу тромбона?');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Алексей - очень скрытный мужчина, о том что у него был оргазм девушки узнают только по 2-м полоскам на тесте.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Еду на машине, все пешеходы - козлы. Иду пешком, все водилы - козлы. Еду на велосипеде, - ваще все козлы!');
