INSERT INTO JOKES (JOKES_TEXT) VALUES ('Эмо-террористы захватили самолёт и расплакались.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('На недавно на состоявшемся краш-тесте Ока была признана самым опасным автомобилем. Пока в неё сажали манекен, ему сломали 2 ноги.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Вам надоело долгое время проводить на кухне, приучайте своих родственников к сырому мясу.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Чем ближе утро, тем удобнее подушка.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Хочешь завести друзей - заведи их подальше. Иван Сусанин.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Поворачиваться задом к человеку невежливо. Красивые девушки вежливы со всех сторон.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Бобруйские петухи по утрам стараются не кричать, дабы не афишировать свой социальный статус.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Немецкие сантехники мечтают просто менять краны.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Девушка с молочной кожей, всегда с прокисшей рожей...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Самого большого леща поймала Зинаида Петровна, забывшая разбудить Иннокентия Павловича на рыбалку...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Степени сравнения скорости происходящего: 1. Быстро 2. Резко 3. И, блять сказать не успел.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Грузия в отместку России сократила закупку пестицидов в России.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('С раскрытым ртом слушает свою жену кандидат наук Иван Петрович, чтобы давление на барабанные перепонки снаружи и изнутри было одинаковым.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('При выборе цветов мужчина делит их на два вида: розы и «а вот это как называется?»');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Вчера двое милиционеров подошли на рынке к гражданину кавказской национальности и предложили поучаствовать в борьбе с коррупцией. Тремястами рублями.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Шутки про Валуева самые избитые.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Отец Федор три года собирает пожертвования на часовню, но пока хватило только на Ауди.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Решил покачать пресс. Лёг на пол. Уснул.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('После третьего стакана на дружеской вечеринке Маша потеряла совесть, а через 17 минут и честь.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Чем больше я узнаю таможенников, тем больше я люблю гаишников.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Мальчик с очень большими легкими может через трубочку пить гуляш.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В Москве открылся пункт выдачи желаемого за действительное.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Сходил на фильм "Вспомнить всё". Вспомнил, что не выключил утюг.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Мужчина это большой ребенок. От титек не оторвать.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Мужик из Удмуртии помыл Якубовичу машину, потому что приехал на поле чудес без подарка.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Сняв сапоги в коридоре, сантехник наследил еще больше.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В армянском детском саду дети после завтрака бреются.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Вчера ящик водки напал на 2-ух мужчин и отобрал у них всю зарплату.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Одинокий брюнет с голубыми глазами, ростом 2 метра, обладающий фигурой Аполлона и приятным тенором продаст котят недорого.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Как тебе моя новая стрижка? Нормально. Отрастет.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Каждый начальник любит пунктуальных подчиненных утром и почему-то ненавидит вечером.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Здравствуйте, меня зовут Надя. Я всегда хотела иметь чернокожего ребенка. Сочи-2014 – это моя Олимпиада.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Если у Вас осталась хоть капля совести, то не всё потеряно! Вам есть таки чем ещё торговать!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('На последнем автосалон в Праге АвтоВАЗ постеснялся снять чехол со своего нового концепт-кара.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Поощрительный диплом на олимпиаде по математике в третьем классе надолго сделал меня заносчивой тварью.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Пачка «Парламента» может из обычного школьника сделать уважаемого человека.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Андрей работает в НИИ и очень любит выпить, поэтому каждые выходные Андрей опровергает фразу: «хорошие специалисты на дороге не валяются».');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Раньше я думал, что бессмертен.  Пока не ударился мизинцем об угол.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Жираф всегда смеется последним.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Внутри каждого яблока спрятан огрызок.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Одна стотысячная секунды - это время между тем как зажегся зеленый свет и гудком сзади.');
