INSERT INTO JOKES (JOKES_TEXT) VALUES ('Детство - это когда спать днем - обязанность, а не роскошь.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Гламурные коровы соглашаются только на кружевные доильные аппараты.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Самые известные песни группы Scorpions: Wind of Changes и та, вторая.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('При сильном испуге у женщин атрофируется небольшая часть мозга, отвечающая за всё.');
