INSERT INTO JOKES (JOKES_TEXT) VALUES ('В Чите, если губернатор не доволен действиями мэра, он стучит ему по батарее.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Воспитанный человек никогда не скажет "Пошёл ты...", он скажет: "Я вижу, вы далеко пойдёте..."');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Учёные доказали что 50 грамм перед едой не только полезно, но и мало.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В доме бардак! Стою с веником и думаю: убраться или... улететь?');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Продам хамелеона синего. Нет, красного. Нет, зеленого. Блин. Круто. Нет, не продам.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Женские и мужские мечты похожи лишь в том, что не сбываются по вине противоположного пола.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Ты обиделась? - Нет, я за топором...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Меня родители в капусте нашли. Судя по сиськам, я её там ела.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Лена не хотела быть жабой, но Борис настаивал, чтоб она взяла его фамилию.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В нашем дворе котят - хоть пруд пруди!');
