INSERT INTO JOKES (JOKES_TEXT) VALUES ('В Китае на уроках труда дети собирают айфоны.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Виагра плюс димедрол - любовь похожая на сон...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Он вышел из бара, бодро постукивая запонками по асфальту.');
