INSERT INTO JOKES (JOKES_TEXT) VALUES ('Мужчина может поклясться в чем угодно, положа руку на сердце женщины.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В прошлый Новый год отказался от оливье. В этот попробую от мандаринок отказаться - надо же выяснить отчего мне так плохо 1 января.');
