INSERT INTO JOKES (JOKES_TEXT) VALUES ('В медсанчасть № 8 на постоянную работу требуется гинеколог. Работа не пыльная…');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Скандал в пекарне: подвыпивший пекарь взялся не за те булки.');
