INSERT INTO JOKES (JOKES_TEXT) VALUES ('Новая бритва для ног брила так гладко, что с Марины сваливались колготки');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Не суди женщину по килограммам, да не будешь судим ею по сантиметрам.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Отец Федор затопил соседей сверху, снизу, справа, слева.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Только в России вы можете посмотреть на стриптизёршу с двумя высшими образованиями, одно из которых - педагогическое.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Ученые скрестили кролика и кота. Он также охотится за мышами, но уже совсем с другой целью.');
