INSERT INTO JOKES (JOKES_TEXT) VALUES ('Искусственный интеллект встречается и у людей.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Я сам раозбарл, поичтсил и сбоарл клаиуавтру.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Ещё хуже... Матросит и не бросает.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Дружба дружбой, но куда девать либидо?!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Электрик Федя случайно уронил оголенные провода в воду и сделал энергетический напиток.');
