INSERT INTO JOKES (JOKES_TEXT) VALUES ('В том, что моя семья распалась, виноваты оба в равной степени: 50% - жена, 50% - теща.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Сотрудники регистратуры в поликлиниках ненавидят людей, но обожают свою работу. Ведь их работа ненавидеть людей.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Горю блондинки не было предела, когда она узнала, что двери в торговом центре открываются не силой её мысли, а автоматически.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Когда я достаю из широких штанин... Сразу же видно что я - армянин!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Специальное предложение от курортных врачей: рентген с обезьянкой!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Делить шкуру неубитого медведя на современном языке называется "бизнес-планирование".');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Увидев падающую звезду, мальчик не успел полностью загадать желание, и теперь он все время хочет.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('За километр до въезда в Торжок расположен баннер - "Еще не поздно".');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Опытный частный детектив быстро и достоверно установит, с чего это вдруг ваш муж такой счастливый.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Когда китайцы дерутся район на район – драку видно из космоса.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Продавец кричит кассиру: Аня, пробей мужчине печень.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Мяукнул на кота, а он на меня посмотрел, как на мудака, - может глупость какую сморозил на их языке?');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Кате нравилась брутальная щетина, запах рыбы и грубые руки, но муж упорно заставлял её следить за собой.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Вышел закон об ущемлении прав импотентов: отреагировали они на него, как обычно, вяло.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Очень позитивный человек в аду был уверен ,что попал в рай.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Ты молод? Активен? Креативен? Легкообучаем? Стрессоустойчив? Коммуникабелен? Мобилен? Садись и переписывай свое шаблонное резюме!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Носки считаются грязными когда начинают различаться на правый и левый.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Когда в беседе с подругой женщина говорит "... и мой тоже...", вероятность того, что вас хвалят равна нулю.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В России готовы легализировать проституцию, при условии, если каждая путана будет асфальтировать свой участок дороги.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Зиту Иванову задолбали вопросом есть ли у нее родная сестра?');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Один мальчик так внимательно смотрел «Сумерки», что у него начались месячные.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Встретимся сегодня? Я бы с радостью, но там такой дубак. Давай весной?');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Ну и разврат! - произнес дождевой червь, увидев тарелку спагетти.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Реклама слабительного: Наше средство действует мягко и нежно, даже не нарушая сна...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В Сургуте на сорокаградусном морозе мальчик, с помощью водяного пистолета, нанёс 20 колотых ранений приставшему к нему гопнику.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Вечерние новости всегда начинаются со слов «Добрый вечер!», а потом начинается рассказ - почему это не так.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Хуже женского бокса - только мужская художественная гимнастика.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Я не уличная девка!... Пошли в подъезд.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Чак Норрис вырвал страницу из Фейсбука.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Порядок, наведенный перед приходом гостей, подобен втянутому животу.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Ограблен склад с Виагрой. При задержании преступники оказались не вооружены, но очень опасны.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Хоть бы раз наш человек сказал, что зря пил. Так нет же! То он зря смешивал, то плохо закусывал…');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Не хочешь что бы твоя девушка залетела? Шпарь другую!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Невнимательный Валерий уходя на работу забыл выключить утюг, но пожара не случилось... ведь его ограбили.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Два мужика как-то поспорили, кто из них дальше высунется из окна. Один, неожиданно для себя, выиграл...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Водитель БЕЛАЗа не знает что такое второстепенная дорога.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Если ты живешь в Беларусии, значит, при рождении ты выбрал сложный уровень.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Начальник отдела по борьбе с наркотиками уже четвертый год не может соскочить с этой должности.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('На скользком крыльце количество культурных людей резко сокращается.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Успешная карьера - это когда вы спешите на работу, в то время как все остальные отправляются на шашлыки.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В походе лишний рот, как нож в спину.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Доехал Иван царевич до камня на распутье, а там надпись: "Поедешь на лево - убью. Твоя Василиса."');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Школьная драка между Лёхой и Масей не состоялась, потому что Лёха был в белых брюках и его матуха бы убила.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Дембель Гриша, вернувшийся домой, еще по надписям в лифте понял, что Маша его не дождалась.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Без руки не вытащишь рыбку из реки.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Если бы в оружейном магазине не требовали справку из психдиспансера, я б давно уже пистолет купил и Вас пристрелил.');
