INSERT INTO JOKES (JOKES_TEXT) VALUES ('Заболел. Залез под одеяло и дышу отварной картошкой. На всякий случай прихватил с собой: вилку, грибочки и водочку. Надеюсь поможет...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Чтобы отечественные спутники больше не падали, депутаты собираются принять ряд важных поправок к закону всемирного тяготения.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Я счастливый человек! Утром мне хочется на работу, а вечером - домой. И не важно, что у меня нет ни того, ни другого.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Решила порадовать мужа праздничным ужином, достала курицу... Долго на нее смотрела... Решила порадовать сексом.');
