INSERT INTO JOKES (JOKES_TEXT) VALUES ('Жизнь человеку дается один раз, причем очень интересным способом!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Вчера гостил у Маши. Надпись в лифте подтвердилась...');
