INSERT INTO JOKES (JOKES_TEXT) VALUES ('Пьяный хирург отказался делать пластическую операцию женщине, сказав, что она и так красивая.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Дети системного администратора в детстве рисуют домен.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('На уроке физкультуры мальчик Петя прыгая через козла, попал в больницу, потому что козел не вовремя поднял голову');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('При помощи обруча и лысого мальчика находчивый учитель астрономии показал детям Сатурн.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Ты посмотри на него! Люди ему общак доверили, а он на эти деньги в Сочи уехал!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Взялся за грудь, говори что-нибудь... Взялся за зад, говори всё подряд. А забрался в трусы - мужиком будь,не ссы!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('После праздников трудовик ставит пятёрки тем… кто пилит тише всех…');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Курить строго запрещено! Курите мягко, по-доброму.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Жена чечёточника ни разу не попадалась с любовником, потому что всегда слышит, как муж возвращается с работы.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Угрожая косинусом шестидесяти, преступники отобрали у Даны Борисовой телефон.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Владелец «Икеи» продал дьяволу душу, но тот не смог собрать ее по инструкции.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Что будет, если скрестить слона с енотом? Енота не будет!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Тагильский завод рыболовных изделий представляет новый продукт – удило из Нижнего Тагила.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('От женщин огромная польза, даже когда пообещают и не приходят: зубы почищены, гладко выбрит и спишь на свежих простынях!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Надпись в туалете: Ничего хорошего из тебя не выйдет!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Белка-блудница живет на два дупла.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('У меня увели мужа... Теперь я поставила решётки на окна сменила замок, сижу и думаю: «ГОСПОДИ хоть бы не вернули!»');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('У нас может быть только 2 реальных прогноза погоды: грязь подсохла и грязь подмёрзла. Остальное просто: грязь!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Химию сдал, физику сдал. Выяснилось, что директор местной школы сдает кабинеты под жилье.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Маугли: Слушай меня, свободная стая! Багира беременна! И так будет с каждым, кто нарушит закон джунглей!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Вчера у начальника Нарофоминского военкомата, родился 27-ми летний сын.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('СЛОВАРЬ: Вдова - это такая женщина, которая точно знает где в настоящий момент находиться ее муж.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Требуется разнорабочий на мебельноколбаснометалургический завод.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Интернет-интернет, отпусти меня в туалет!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('У унитазов тоже будет праздник, Их новогодний ждет сюрприз! И вместо надоевших жирных задниц, Они увидят много новых лиц!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Самая эрудированная телепередача в России - «Давай поженимся», ибо на ее фоне все люди автоматически становятся умнее.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Во время падения звезды восьмиклассник Серёжа не успел определиться с желанием и на следующий день стал обладателем многоскоростного велосипеда с сиськами.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Эротическй массаж. Телефон - 02.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Почему снег не всегда белый? Потому что туалеты не всегда бесплатные.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В детских садиках Китая дети начинают утро с зарядки и только потом делают сам телефон.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Просьба отключить мобильные телефоны в партере... и пейджеры на балконе...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('На детском утреннике мальчик в костюме грибника пнул ногой мальчика в костюме мухомора.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Известно семь способов переспорить женщину — и ни один из них не работает.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('ВКонтакте был найден самый долгий статус – «Сегодня мой первый прыжок с парашютом!»');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Невероятно, но факт. мальчика, похожего на Влада Сташевского, не узнают на улицах.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Больной пошел на поправку. Но не дошел...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Эх. Сейчас бы собрать все деньги, которые я когда-то пропил… И снова их пропить…');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В пищевой промышленности Советского Союза тоже применялись усилители вкуса… Они назывались «дефицит» и «очередь».');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Чтоб я видел тебя на костылях, а ты меня - одним глазом!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Дети на заднем сидении приводят к несчастному случаю, несчастный случай на заднем сидении приводит к детям.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Ты получил высшее образование? Салон «Евросеть» ждет тебя.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Физрук с сорокалетним стажем вышел на работу трезвым и не нашел школу.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Сориентироваться в городе очень просто - по кондиционерам на южной стороне домов.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Рабинович, скажите, вы счастливы? А шо делать?');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Дельфины - умные существа. Еще ни один дельфин не оформил ипотеку.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Валентина из Твери давно считала себя святой. Она стояла на трассе и продавала свои мощи.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Семидесятивосьмилетняя Клавдия Петровна прекрасно знала, что на нее никто не подумает, поэтому спокойно жгла кнопки в лифте.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Все нормальные люди ищут любовь, свое место в жизни, а я, блядь, - второй носок...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Гости никак не хотели расходиться, пока я не напилась и не разошлась сама!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Русские туристы пригрозили подавить волнения в Египте, если им будут мешать отдыхать.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Больной, подготовьтесь, сейчас будет больно… Подготовились? С Вас 50 тысяч.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Эх, хорошо быть подполковником, хотя и под майором тоже ничего.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В Тель-Авиве живут самые отзывчивые люди, на объявление: кто потерял кошелек с пятью тысячами евро - откликнулось 200 тыс. человек.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Ленин в тюрме вылепил из хлеба Крупскую и макнул в неё.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Не завела любовника - сиди в одноклассниках!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Oптимист верит, что мы живем в лучшем из миров. Пессимист боится, что так оно и есть.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('У веселого молочника умерла корова, и он стал грустным мясником.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Не понимаю, когда в ужастиках человек один в квартире и спрашивает: здесь кто-нибудь есть?, как будто убийца ему ответит: да я тут на кухне, одну секунду, жаркое будет скоро готово?');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Алименты - это членские взносы...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Это зимой они Дед Мороз и Снегурочка. А летом - фотограф и обезьянка!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Решил вести здоровый образ жизни, купил велик. Теперь за пивом и сигаретами езжу на велике.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Чтобы заманить людей на свой концерт, Андрей Губин выложил дорогу к залу сосисками.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Только интеллегентные девушки знают, что слово невротик пишется слитно.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Прочитал, что большинство талантливых людей ленивы. Сомнения в сторону, я - талант.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В гостях хорошо, а дома пукнуть можно.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Жадные родители говорят сыну: «Мы тебе сейчас ничего не дарим, но это тебе на день рождения».');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Школьная повариха тетя Зина устроилась работать барменом, но какой бы коктейль она не готовила - все равно получается борщ.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Хочу работать. Только что-то мне мешает... Из дневника танцора Большого театра.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('А на Ксению Собчак с детства делали большие ставки.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Обмани ближнего своего дважды, ибо он обманув тебя однажды возрадуется...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Вся история женской моды — это история борьбы климата, морали и гигиены с желанием женщины ходить голой.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Алкоголь-враг семьи. ПАПА СПРАВИТСЯ!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Лев Лещенко – царь зверей или рыба?');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Обещание вернуть деньги через неделю, означает только просьбу - неделю не приставать с этим вопросом.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Мы с ней дружили понемногу, потом она ушла. Я стал дружить один.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В банке поставили стеклянные сейфы и каждому вкладчику камень в подарок.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Сергей Зверев, когда видит себя в зеркале, непроизвольно кончает.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Соседи совсем обалдели! 3 часа ночи, по батареям долбят! Хорошо я не сплю, на гармошке играю!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Великая радость пришла в Иваново. Размеры радости измеряются и передаются из уст в уста.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Я объясняю на пальцах! Средний видишь?');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Уважаемые отдыхающие! Море, как и человек, на 80% состоит из воды. И все это благодаря Вам, уважаемые отдыхающие.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Милиции удалось установить, что надпись на двери городского пенсионного фонда "Цой жив" сделал пенсионер Дмитрий Алексеевич Цой, которому уже три месяца не приносили пенсию.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Если на дороге в Латвии тебя обогнал эстонец, значит ты - финн.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Цены на концерт Стаса Михайлова зашкаливают, поговаривают даже, что некоторые берут билеты в ипотеку.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Мам, какое у меня было первое слово? Когда будет 18, узнаешь.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В аптеке: Мужчина, чтобы купить мышьяк, нужен рецепт... Одной фотографии тещи недостаточно.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Если ты наклонился и обнаружил у себя 4 яйца... не обольщайся, убедись, что тебе не присунули...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Бараны на заднем дворе шашлычной подслушивали заказ и, если что, прятались в свинарнике.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Разница в размахе между Ноем и дедом Мазаем показывает, насколько важна грамотная PR-компания и талантливый креативный директор.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('«Посмотрите, кто к нам пришел!» сказал Игорь, а сам не посмотрел.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Анджелина Джоли выступает за отмену права последнего желания у приговоренных к казни.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Теперь, прежде чем помочь человеку в беде, люди сначала снимают эту беду на телефон…');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Губернаторам надо иметь больше детей - тогда в России будет больше успешных молодых предпринимателей.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Набирая песок для новой кошки, маленький Петя нашел старую.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Когда Далю были нужны новые слова, он приезжал в деревню, разбивал на глазах мужиков 2–3 бутылки водки, а потом стоял и записывал.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Если у вас есть проблема, и вы собираетесь её решать с помощью регулярных выражений, тогда у вас будет уже две проблемы...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Отдам крокодила в хорошие, вкусные руки!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Сложившаяся стремянка научила строго деда делать шпагат.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Беременные лошади бегают быстрее, потому что в них больше лошадиных сил.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В семье, где нет холодильника, самый младший висит за окном и держит пакет с продуктами.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Пилоты самолета ТУ-154 чуть не сошли с ума, когда встречный лайнер с русскими туристами побибикал и мигнул фарами.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Однажды меня спросили: что ты выбираешь, большой член или хорошую память? И что ты ответил? - Не помню.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Страшненькие девушки, сделавшие на спине тату лица Анжелины Джоли, всегда нарасхват.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Тюменская девочка, пытаясь похоронить хомячка, стала нефтяной магнаткой.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('На флюорографии Сальвадора Дали левое легкое плавно перетекает в винтовую лестницу, стоящую на трех слонах.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Крыжопольские родители объявили об отзыве невест 1979-1982 года выпуска, из-за обнаруженного дефекта в конструкции.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Если тебя ударили по левой щеке - подставь правую… а потом подай в суд за оба раза.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Поговаривают, что Белка и Стрелка были собаками неугодными Сталинскому режиму.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Самая классная штука - это штука баксов!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Дж. Буш был разъярен, узнав, что весь мир пользуется арабскими цифрами.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Бумажный завод накрыл каменный и выиграл.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Иван Иванович Иванов никогда не заполняет никакие бланки. Он просто тупо крадёт образец...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Встретились как-то человек-паук, человек-баклан и женщина-кошка. "Я собрал вас неслучайно" - обратился к ним Человек-психиатр.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Жидкость, погруженная в тело, через семь лет пойдет в школу.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Что Вы хотите от нашей эстрады, если настоящие мужчины играют в хоккей?');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Сборная России по боксу усиленно готовится к Сочи-2014. Вроде Олимпиада не летняя, но я бы не расстраивал ребят.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Ходят слухи, что в нашей столовой травятся люди, но меня пока пронесло.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Голландские учёные установили, что если очень долго смотреть в одну точку, придут родители и попалят.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Аленушка первой из девушек доказала, что все мужики козлы, стоит им только напиться.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Алена Апина ищет своих фанатов через программу «Жди меня».');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Фу, какая гадость это ваше семь утра!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Секс - дело вкуса. Для одного это плохо, для двоих хорошо.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Писающий мальчик как и его создатель, тоже отливает из бронзы.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Моя вторая теща гораздо понятливей первой - все поняла с первого удара.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Обьявление: Таксисту, нашедшему в своей машине документы с грифом "СОВЕРШЕННО СЕКРЕТНО", предлагается застрелиться самому…');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('От женщины никогда не знаешь что ожидать - девочку или мальчика...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Для токсикомана со стажем, каждый момент был запоминающимся.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В продажу поступило новое грузинское марочное вино: "Васнаебали".');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Дагестанским детям в Мультике «Ну, Погоди» больше всего нравится коренастый бобёр-самбист.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Появились новые колготки из коноплянных волокон - теперь каждая затяжка в радость!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Тебе скучно и одиноко? Не с кем поговорить? Ничего не поделаешь, тюрьма.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('«А как всё начиналось!» - сказал БОМЖ раскладывая закуску на своём красном дипломе.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Что такое разврат? Это раз в рот, раз в зад.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Чеченец-логопед убедил таксиста, что правильно говорить не «Две», а «Полторы тысячи».');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('На заметку детям: презерватив, подкинутый в папин карман, отвлекает родителей от глупых вопросов о школе.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('С дуру можно и хуй сломать, несмотря на то, что это гидравлика!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Праздничной стрельбой в воздух отметили жители Чечни начало вещания телеканала "Культура".');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Дачник-нудист каждое лето заставляет очень рано краснеть клубнику.');
