INSERT INTO JOKES (JOKES_TEXT) VALUES ('Руки, растущие из жопы — самая распространенная мутация на Земле.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Мы не продаем сигареты лицам моложе 18-ти лет. Это закон. Возьми так, девочка. Это подарок…');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Жители Алупки всегда со смущением отвечают на вопрос "Откуда Вы?"');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Пусть ему "земля-земля" будет пухом!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('На среду, дети, выучите любое из стихотворений Маяковского. Про БЛЯДЕЙ - нельзя!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Новые сигареты специально для школьников "Родительское sobranie", теперь со вкусом ремня.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Огурец соленый - растение семейства закусочных.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Во время кастинга на фильм "300 спартанцев", всех слабых и некрасивых актеров выкидывали в "самый лучший фильм".');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Лучше жен могут быть только жены, на которых еще не бывал.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Пристегнутый водитель, выпадая из «Оки», может случайно кинуть её через бедро.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Дорогой, что тебе приготовить на завтрак? Есть йогурт, творожок, можно мюсли с молоком. - Давай йогурт, творог, мюсли. И что-нибудь пожрать.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Очень толстая охотничья собака приносит охотнику извинения.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('С женщиной нужно быть жестким и строгим: причинять радость, наносить добро, подвергать ласке!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В сетевую компанию требуются энергичные целеустремленные молодые люди. Не гербалайф. Навоз. Мы говорим людям правду!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Хирург-трансплантолог Иванов, по дороге на работу, делает до 3-х пересадок.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Прекрасный денёк: вот тебе и мыло душистое, и веревка пушистая.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Люби ближнего. Но не попадайся.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Привет! Давно не виделись, как ты возмужал! А как ты-то возбабела!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Оторвали Ваньке встаньку...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Говорил же, учи английский, Глашенька... это не "в рот хер", а "Brother" - бестолочь, ты, эдакая.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Если утром жена с Вами не разговаривает - значит, пьянка удалась!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Папа пришел домой пьяный. Ватикан в шоке!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Палец от станка не далеко падает.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Учебный год, как беременность - длится 9 месяцев, а тошнить начинает со второй недели.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Чемпионат по прыжкам в бетонную стену закончился на стадии отбора.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Моя девушка, никогда не будет клянчить у меня деньги. Она не такой человек. Она подворовывает.');
