INSERT INTO JOKES (JOKES_TEXT) VALUES ('Комбайнер Серега перевыполнил план. Теперь, отец уже 9 детей может полностью сосредоточиться на работе комбайнера.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Твои глаза, как шишки геммороя… И днем и ночью не дают покоя!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Очень неожиданно закончилось ограбление казино: всю добычу поставили на "семь красное".');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Вася на морозе лизнул трансформаторную будку, друзья принесли кипяток, и это его погубило.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Если женщина спрашивает: Спать идем? Это означает: Мы идем спать. Выключай компьютер!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Самый жизнерадостный боксер бьет только в сплетение, потому что оно СОЛНЕЧНОЕ!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В Архангельске в одном месте всей семьей принято встречаться дважды. Когда все едят арбуз и через час после этого.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В Новосибирске прошел конкурс на самое нелепое имя. Победила - заняла первое место');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Воспитанный мужчина не сделает замечание женщине, плохо несущей шпалу.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Коты между собой называют «Вискас» вискарём.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('2025 год: США обещают напасть на Солнце, если там не прекратятся ядерные реакции.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Любая фразой дерматолога заканчивается словами «Чеши отсюда».');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Я люблю пожёстче... и это ещё мягко сказано...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Главное - не решить проблему, а вовремя найти виноватого.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Если китайские школьники забывают сменную обувь, они делают ее по дороге в школу.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Что надо говорить, когда получаешь зарплату? - Здравствуй, моя маленькая!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Зачем жениться? Просто найди женщину которую возненавидишь через пять лет и отдай ей свой дом.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Мотайте все это себе на усы! У кого нет усов - мотайте на уши!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Взрослый - это тогда когда идёшь зимой по улице без шапки и понимаешь что ты дибил.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Я смотрю, зритель уже потянулся к выходу, а это значит, наш спектакль набирает обороты.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Захотелось серьезных долговременных отношений. Подрочил. Прошло!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Белый танец был придуман для того, чтобы у некрасивых девушек тоже был шанс.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Слово «вобла» произошло от восклицания рыбака, поймавшего большую рыбу.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Трагедия в заполярье. Принимавший душ полярник, погиб от многочисленных колотых ран.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Попил чай с родителями. Прикольные ребята. Надо еще как-нибудь с ними пообщаться...');
