INSERT INTO JOKES (JOKES_TEXT) VALUES ('Тюремный оркестр «#ля! диез».');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('И за что я его полюбила... Ярко выраженного дебила.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('«Да пошел ты на хуй» - подумал я, и отправил смайлик.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Почему до сих пор молокопроизводители не застолбили брэнд:"Веселая молочница"?');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Завтра в городе выступит театр одного актера. Весь билет продан.');
