INSERT INTO JOKES (JOKES_TEXT) VALUES ('Если заменить «аминь» на «такая вот херня», многое станет на свои места.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Поселок Строитель был признан наукоградом за активное развитие на-на технологий!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В Сочинских школах практика забирать с уроков «двух-трех крепких мальчиков» набирает обороты с приближением даты сдачи Олимпийских объектов.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Парень, ревнующий свою девушку к каждому столбу, оставил район без света.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Путана, запутавшаяся в проводах, помогла электрику снять напряжение.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Юрий Куклачев тычет жену лицом в пережаренную картошку.');
