INSERT INTO JOKES (JOKES_TEXT) VALUES ('Владимир Сергеевич никогда не касается своих колен, потому что это ниже его достоинства.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('От знаний еще никто не умирал, но рисковать не стоит.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Человек упал с 10 этажа и не разбился. Так целого и похоронили.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Психологический тест для физиков: жалко ли вам кота Шрёдингера?');
