INSERT INTO JOKES (JOKES_TEXT) VALUES ('В Русском музее открылась экспозиция изображений на аву. Оглушительным успехом пользовались картины в лифчике на фоне ковра и сидя на кортах на рельсах.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Кто не работает, тот поломался.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('После того, как маленький Витя научился считать, папе пришлось делить пельмени поровну.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Наказание для манекенщицы: "Три наряда вне очереди!"');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Свидетельство о браке - официальное разрешение на секс.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Фраерки, пишет вам редакция НТВ, а есть ли у вас, что-то из чёрного юмора?');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Когда ведущий "необъяснимо, но факт" ссорится с женой, в его доме появляются летающие тарелки.');
