INSERT INTO JOKES (JOKES_TEXT) VALUES ('Не знаете чем занять тещу во время очередного полугодового визита? Купите ей паззл неба и отрежьте соединительные пипки в случайном порядке.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В Греции найдено дерево, которому 3000 лет. По свидетельству ученых, если бы дерево могло говорить, у него был бы рот.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Не будь унылым говном, будь озорной какашкой!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Все бабы, как бабы, а я богиня. Мисс Рязань 2012.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Библиотекарь Петров скачав в интернете книгу, через неделю возвращает ее обратно на сайт.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Как пить? Дорогое французское вино: Купил - Поставил - Смотрю. Водка: Выпил - Захотел - Соблазнил - Опозорился - Уснул. Турецкая водка: Привез - Открыл - Попробовал - Закрыл - Подарил.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Самый невнимательный бухгалтер в мире не понаслышке знает, что такое чефир и ходка.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Всероссийская конференция по борьбе с пьянством и матом завершилась общим фуршетом и взаимным обменом посланиями.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Молоко вдвойне вкусней, если пить из двух грудей!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Если после пьянки осталось спиртное - значит внутри коллектива существует проблема.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Как стать гениальным художником? Споткнуться о ведро краски и подождать 100 лет.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Холодную водку я обожаю. Теплую, тоже люблю! Но если водка мешает работе - ну её к черту! Работу...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('У девочки с хорошим воображением самый незабываемый секс случился в полной темноте и полном одиночестве!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('При встрече горбатого трубочиста и бабы с пустым ведром происходит их взаимная аннигиляция.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Женщина с красивыми зубами все находит смешным.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Курьёз в Индии. Русский турист назвал свою жену коровой и их бесплатно поселили в президентский люкс.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Раньше после умывания я чувствовала сухость кожи... но потом наконец-то нам дали воду!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Загадочная женщина загадит жизнь кому угодно... А если не успеет, то придет догадливая и догадит.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Мамы объявили об отзыве с улиц детей 1998 и 1999 годов выпуска, потому что ужин стынет.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Женятся и выходят замуж зайки, котики и солнышки, а разводятся козлы, суки и олени.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Криминальные новости: Суся, Муся и Пупсик на деле оказались Мямлями.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Я уже определился с теми людьми, на которых я буду срать если стану птицей!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Чем больше индеец совершает подвигов, тем больше париков у его жены.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Сын борца сумо всю жизнь мечтал обнять отца.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Клоун в законе наколол себе на спине купол цирка.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Однажды в детсаду все дети лепили из пластилина, а Андрюша был наказан и ковал из стали.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Встретил Мальчик-с-пальчик Карлика-носа и заковырял его до смерти.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Страшный ураган унес и продал инкассаторскую машину.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Многие холостяки мечтают о кpасивой, умной и заботливой жене. Многие женатые мечтают о том же.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Настоящая мегера должна в жизни сделать 3 дела: посадить соседа, вырастить оболтуса и построить мужа...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Есть вещи, которые лучше не знать. И, судя по всему, большинство считает, что это гларматика и пункгтуация.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Отдам питбуля в хорошие руки. Милый, добрый, любит бабушек. Одна бабушка в неделю...');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('В музее восковых фигур Мадам Тюссо Андрей Аршавин изображен сидя на скамейке.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Стриптизер в шерстяных трусах, танцевавший вокруг эбонитового шеста, осветил Мытищи.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('После того, как пожар от огнетушителя стал еще сильней, Варвара Петровна поняла где дети прятали от неё алкоголь.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Сотрудник ДПС оштрафовал путану за превышение стоимости');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Уборщица ночного клуба нашла какую то таблетку. К утру город сиял чистотой…');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Когда девушка в Индии согласна, красная точка на лбу становится зеленой.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Селекционеры скрестили пальцы, после последнего своего эксперимента.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Почта России от души поздравляет россиян с новым 2013 годом!');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Вам когда-нибудь дарили Валентинку на Первое апреля?');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Пьяный админ винде не хозяин.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Хорошо быть бабочкой-однодневкой: вздремнул после обеда и проспал кризис среднего возраста.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Скинхеды не трогали негра по имени Манту, потому что манту мочить нельзя.');
INSERT INTO JOKES (JOKES_TEXT) VALUES ('Человек на 80% состоит из воды. Если у человека нет мечты или цели в жизни, то он всего лишь вертикальная лужа.');
